INSERT INTO `bs_catalog_item` VALUES (1,1,3,1,'Nokia 5320 blue','<strong>Описание:</strong><br />\r\nСмартфон, поддерживающий 3G/HSDPA сети. У этой модели появилась новая и довольно таки интересная функция, которая отличает ее от других телефонов этой серии &ndash; приложение Nokia Say and Play (голосовое управление музыкальными функциями смартфона). Nokia 5320 предлагает массу возможностей для работы с музыкой: кнопки управления на корпусе, функцию стерео Bluetooth (A2DP), стерео FM радио и стандартный аудио-выход. А для повышения качества звука в смартфон встроен специальный аудио чип. Слот для microSD карты позволит увеличить объем памяти до 8 Гб. Стоит также отметить, что данный смартфон поддерживает N-Gage игры, что обязательно должно порадовать большинство будущих пользователей.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nТелефон Nokia 5320 - это мечта всех меломанов. Стильный, компактный, напичкан всяким новшеством для усиления звука и качества аппарат, становится лакомым кусочком для любой возрастной категории покупателей. Наслаждение любимой музыкой станет еще большим удовольствием благодаря такому &laquo;другу&raquo; как Nokia 5320.<br />\r\n<br />\r\n&nbsp;&nbsp;',1,'1650.00','1','1','2009-06-05 18:17:22','Nokia 5320 blue','Nokia 5320 blue','Nokia 5320 blue','Nokia 5320 blue','nokia-5320-blue-','','','',14),(2,1,3,1,'Nokia 5320 red','<strong>Описание:</strong><br />\r\nСмартфон, поддерживающий 3G/HSDPA сети. У этой модели появилась новая и довольно таки интересная функция, которая отличает ее от других телефонов этой серии – приложение Nokia Say and Play (голосовое управление музыкальными функциями смартфона). Nokia 5320 предлагает массу возможностей для работы с музыкой: кнопки управления на корпусе, функцию стерео Bluetooth (A2DP), стерео FM радио и стандартный аудио-выход. А для повышения качества звука в смартфон встроен специальный аудио чип. Слот для microSD карты позволит увеличить объем памяти до 8 Гб. Стоит также отметить, что данный смартфон поддерживает N-Gage игры, что обязательно должно порадовать большинство будущих пользователей.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nТелефон Nokia 5320 - это мечта всех меломанов. Стильный, компактный, напичкан всяким новшеством для усиления звука и качества аппарат, становится лакомым кусочком для любой возрастной категории покупателей. Наслаждение любимой музыкой станет еще большим удовольствием благодаря такому «другу» как Nokia 5320.<br />\r\n<br />\r\n ',2,'1650.00','1','1','2009-06-05 18:17:22','Nokia 5320 red','Nokia 5320 red','Nokia 5320 red','Nokia 5320 red','nokia-5320-red-','','','',12),(3,1,3,1,'Nokia 6120c white','<strong>Описание:</strong><br />\r\nNokia 6120 classic - Смартфон  поддерживающий 3G/HSDPA сети. Выполненный в классическом дизайне, и отвечает всем основным коммуникационным потребностям пользователей. Смартфон отличается простотой работы с сообщениями и очень хорошей эргономикой, очень быстрым процессором и отличным дисплеем. Будьте на вершине деловой жизни, отправляя и получая электронные письма с прикрепленными файлами. Снимайте на видео все, что происходит вокруг.Встроенная 2 Мпикс. фотокамера подарит незабываемые изображения, а дополнительная фронтальная камера открывает возможности для видео телефонии. Расслабьтесь под любимую музыку в музыкальном проигрывателе. <br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nФункциональный и очень быстрый Смартфон третьего поколения и стильный &laquo;классический&raquo; телефон - будет у вас в кармане, если вы выберете этот стильный аппарат.<br />\r\n<br />\r\n&nbsp;',3,'1550.00','1','1','2009-06-05 18:17:22','Nokia 6120c white','Nokia 6120c white','Nokia 6120c white','Nokia 6120c white','nokia-6120c-white-','','','',11),(4,1,3,1,'Nokia 2600с gold','<strong>Описание:</strong><br />\r\nМоноблок Nokia 2600 classic выдержан в стандартном классическом стиле. Основным преимуществом этой модели стал ее миниатюрный корпус, неординарный дизайн и сменные панели. Что кас