,'Nokia 7210 pink','Nokia 7210 pink','Nokia 7210 pink','Nokia 7210 pink','nokia-7210-pink-','','','',12),(50,1,3,1,'Nokia 7310 blue-green','<strong>Описание:</strong><br />\r\nNokia 7310 Supernova позиционируется в качестве стильного аксессуара для девушек. Этот телефон доступен в двух цветовых решениях, каждое из которых комплектуется дополнительной сменной панелью (синия+зелёная или розовая+синяя). Аппарат работает в сетях GSM/EDGE, снимает 2-мегапиксельной камерой, память телефона можно расширить до 8 Гб. Флеш-плеер, музыкальный и видеоплеер, радио, доступ к сервисам Yahoo представляют мультимедийные возможности телефона.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nТонкий стильный моноблок очень хорошей сборки с качественным дисплеем, отличной функциональностью и поддержкой карт памяти до 8 gb.<br />\r\n<br />\r\n<br />',50,'1350.00','1','1','2009-06-05 18:17:22','Nokia 7310 blue-green','Nokia 7310 blue-green','Nokia 7310 blue-green','Nokia 7310 blue-green','nokia-7310-blue-green-','','','',12),(51,1,3,1,'Nokia 7310 blue-pink','<strong>Описание:</strong><br />\r\nNokia 7310 Supernova позиционируется в качестве стильного аксессуара для девушек. Этот телефон доступен в двух цветовых решениях, каждое из которых комплектуется дополнительной сменной панелью (синия+зелёная или розовая+синяя). Аппарат работает в сетях GSM/EDGE, снимает 2-мегапиксельной камерой, память телефона можно расширить до 8 Гб. Флеш-плеер, музыкальный и видеоплеер, радио, доступ к сервисам Yahoo представляют мультимедийные возможности телефона.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nТонкий стильный моноблок очень хорошей сборки с качественным дисплеем, отличной функциональностью и поддержкой карт памяти до 8 gb.&nbsp;',51,'1350.00','1','1','2009-06-05 18:17:22','Nokia 7310 blue-pink','Nokia 7310 blue-pink','Nokia 7310 blue-pink','Nokia 7310 blue-pink','nokia-7310-blue-pink-','','','',12),(52,1,3,1,'Nokia 7500 black','<strong>Описание:</strong><br />\r\nNokia 7500 Prism просто создана привлекать к себе внимание, ведь весь телефон состоит из различных треугольников и ромбиков, они есть и на лицевой панели, и на задней части аппарата. На лицевой части они объемные, и вся панель отблескивает гранями, большинство из них матовые, но встречаются и глянцевые, создающие подобие &quot;игры света&quot;. Имиджевый аппарат помимо оригинального дизайна имеет не плохую начинку: 2-мегапиксельная камера со вспышкой, большой дисплей 240x320 точек, поддерживаюший 16 миллионов цветов, FM приемник, слот для карт памяти.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nСтильный имиджевый дизайн, поражающий своим необычым оформлениеми функциональностью. Хорошее соотношение &quot;цена - функциональность&quot;.<br />\r\n<br />\r\n<br />',52,'1200.00','1','1','2009-06-05 18:17:22','Nokia 7500 black','Nokia 7500 black','Nokia 7500 black','Nokia 7500 black','nokia-7500-black-','','','',11),(53,1,3,1,'Nokia 8800 Arte Southern black','<strong>Описание:</strong><br />\r\nNokia 8800 Arte призвана подчеркнуть искусство индивидуальности с помощью естественных цветов, узоров. Аппарат изготовлен из высококачественных материалов, которые приятны на ощупь. Кроме того, глаз радует внешний минимализм. Устройство изготовлено с применением металла и стекла и имеет покрытие, устойчивое к появлению отпечатков пальцев. В телефоне 8800 Arte собраны уникальные функции, так например переворот телефона дисплеем вниз переводит звонок в режим &quot;тихо&quot; (гасит мелодию вызова), а двойное постукивание по экрану активирует заставку - аналоговые часы.Также в телефоне отличный дисплей , поддержка 3G сетей и камера 3.2 мр.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nЭлегантный и изящный дизайн этой модели вдохновлён самой природой и выгодно выделяет его из массы. Бесшовный снаружи корпус из металла и стекла, имеющий специальное покрытие, на котором не остаются отпечатки пальцев, придаёт Nokia 8800 Arte особый шик.<br />',53,'9200.00','1','1','2009-06-05 18:17:22','Nokia 8800 Arte Southern black','Nokia 8800 Arte Southern black','Nokia 8800 Arte Southern black','Nokia 8800 Arte Southern black','nokia-8800-arte-southern-black-','','','',11),(54,1,3,1,'Nokia 8800 Carbon titanium','<strong>Описание:</strong><br />\r\nNokia 8800 Carbon Titanium сделана с применением нехарактерных для обычных сотовых телефонов материалов: в конструкции аппарата используются углеродное волокно, титан, полированное стекло и нержавеющая сталь, а специальное покрытие защищает от налипания грязи. Двойное прикосновение к металлической области под дисплеем активирует заставку &ndash; аналоговые часы. Во время поступления входящего звонка внешний динамик можно легко приглушить &ndash; для этого достаточно повернуть телефон дисплеем книзу. Вдобавок к поддержке сетей 3G, новый телефон обладает встроенной 3,2-МП камерой с автофокусом, высококачественным динамиком и объемом внутренней памяти &ndash; 4 ГБ . Дисплей выполнен по технологии OLED. В память телефона записаны эксклюзивные мелодии и рисунки рабочего стола.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nИмиджевый телефон-слайдер Nokia 8800 Carbon Titanium, отличающийся эффектным дизайном своего корпуса, изготовленного из углеродного волокна, титана, полированного стекла и нержавеющей стали а также богатая его комплектация наверняка заинтересует всех Любителей экстравагантных продуктов.&nbsp;<br />\r\n<br />\r\n<br />',54,'11525.00','1','1','2009-06-05 18:17:22','Nokia 8800 Carbon titanium','Nokia 8800 Carbon titanium','Nokia 8800 Carbon titanium','Nokia 8800 Carbon titanium','nokia-8800-carbon-titanium-','','','',11),(55,1,3,1,'Nokia 8800 Sapphire Art','<strong>Описание:</strong><br />\r\nNokia 8800 Sapphire Arte- стильный аппарат премиум класса, заключен в стильный раздвижной корпус из полированной стали, кожи из западной Индии и сапфиров. Корпус имеет специальное покрытие предотвращающеее появление на защитном стекле экрана и корпусе отпечатков пальцев. Интересной особенностью аппаратов серии Nokia 8800 Sapphire Arte является возможность приглушить звук одним движением: просто повернув телефон экраном вниз. Телефон имеет отличный дисплей и 3.2мр камеру.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nЭлегантный и изящный, богатый дизайн этой модели вдохновлён самой природой и выгодно выделяет его из массы. Отделка стали,кожи и сапфиром заслуживает высоких похвал.&nbsp;<br />\r\n<br />\r\n<br />',55,'10990.00','1','1','2009-06-05 18:17:22','Nokia 8800 Sapphire Art','Nokia 8800 Sapphire Art','Nokia 8800 Sapphire Art','Nokia 8800 Sapphire Art','nokia-8800-sapphire-art-','','','',13),(56,1,3,1,'Nokia E51-1 Black','<strong>Описание:</strong><br />\r\nNokia E51 - это бизнес-смартфон под управлением Symbian OS v9.2, и в то же время тонкий моноблок. Этот аппарат позволяет быстро и без проблем получать доступ к важнейшим бизнес-приложениям, интернет-сервисам, контактами и другим полезным функциям, необходимым каждому деловому человеку.Nokia E51 идеально подходит той категории пользователей сотовой связи, которые нуждаются в мобильном терминале с простым управлением, присущем обычным телефонам, и функциональности E-серии с её расширенными бизнес-возможностями. Телефон оснащен всеми современными коммуникационными интерфейсами, поддержкой большинства форматов офисных приложений и мультимедии.&nbsp;<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nNokia E51 &ndash; уникальное предложение для своего сегмента. Конкурентов для этого аппарата на рынке просто нет. Тонкого моноблока с высокими коммуникационными возможностями вам найти просто не удастся.&nbsp;',56,'2100.00','1','1','2009-06-05 18:17:22','Nokia E51-1 Black','Nokia E51-1 Black','Nokia E51-1 Black','Nokia E51-1 Black','nokia-e51-1-black-','','','',14),(57,1,3,1,'Nokia E51-1 White steel','<strong>Описание:</strong><br />\r\nNokia E51 - это бизнес-смартфон под управлением Symbian OS v9.2, и в то же время тонкий моноблок. Этот аппарат позволяет быстро и без проблем получать дос