ивную цветовую гамму. Обладает полным набором радиомодулей (четырехдиапазонный GSM, GPRS/EDGE/UMTS, Bluetooth 2.0, WiFi), качественным ЖК-дисплеем поддержкой 16 млн цветов, 2-мегапиксельной камерой, слотом расширения microSD до 2 Гб.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nNokia E65, тонкий слайдер бизнес-класса в оригинальном дизайнерском решении и с полнофункциональной начинкой. Самый лучший выбор из одновременно &laquo;красивых&raquo; и &laquo;функциональных&raquo; телефонов для бизнес людей.<br />\r\n<br />\r\n<br />',69,'2065.00','1','1','2009-06-05 18:17:22','Nokia E65-1 mocca silver','Nokia E65-1 mocca silver','Nokia E65-1 mocca silver','Nokia E65-1 mocca silver','nokia-e65-1-mocca-silver-','','','',12),(70,1,3,1,'Nokia E71 Grey','<strong>Описание:</strong><br />\r\nNokia E71 - это самое тонкое и быстрое устройство с полноценной QWERTY-клавиатурой. В ваших руках настоящий, верный помощник. Вы всегда можете быть на связи благодаря подключениям 3G, HSPDA и WLAN , постоянно работать с электронной почтой и с полноценным мобильным браузером. Вы сможете быть мобильным и пунктуальным благодаря поиску маршрутов с Nokia Maps и встроенному GPS-модулю. Безусловные преимущества новой модели Nokia.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nNokia E71 &mdash; стильный, модный смартфон, который имеет большое количество полезных функций как для работы так и для развлечения. Удобен в применении, имеет прекрасный внешний вид и отличное качество. Если вы тот человек, которому телефон нужен не только чтобы &laquo;просто звонить&raquo;, то этот телефон именно для вас!<br />\r\n<br />\r\n<br />',70,'3600.00','1','1','2009-06-05 18:17:22','Nokia E71 Grey','Nokia E71 Grey','Nokia E71 Grey','Nokia E71 Grey','nokia-e71-grey-','','','',11),(71,1,3,1,'Nokia N81 black','<strong>Описание:</strong><br />\r\nNokia N81 &ndash; мощное мультимедийное решение, которое привлекает искушённого пользователя не только функциональностью, но и уравновешенным дизайном. 