раздвижной механизм, большой 2,8-дюймовый дисплей, встроенноую память 16 Гбайт и поддержку различных видео-форматов открывает новую захватывающую главу в истории мобильных медиатехнологий.. Большой яркий дисплей, различные варианты высокоскоростного подключения и расширенные функции Nokia Video Center &ndash; все это делает Nokia N96 персональным окном в мир развлечений. <br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nОснащенный выделенными клавишами управления музыкой и играми, ТВ-тюнером и 16 ГБ встроенной памяти, а также поддержкой сетей 3G и WLAN, мультимедийный компьютер Nokia N96 представляет собой настоящий мобильный центр развлечений.<br />\r\n<br />\r\n&nbsp;',75,'5100.00','1','1','2009-06-05 18:17:22','Nokia N96 black','Nokia N96 black','Nokia N96 black','Nokia N96 black','nokia-n96-black-','','','',11),(76,1,3,1,'Nokia 7900 black','<strong>Описание:</strong><br />\r\nВас ошеломит современный дизайн, кристаллические узоры и лазерная гравировка на алюминиевом корпусе.Глянцевая лакрично-черная передняя панель Nokia 7900 Prism контрастирует с прохладной на ощупь задней крышкой из анодированного алюминия. В Nokia 7900 Prism &ndash; применен основной дисплей на органических светодиодах, поддерживающий до 16 миллионов цветов, на котором отображается яркая графическая заставка. Кроме того, &laquo;живые обои&raquo; рабочего стола Nokia 7900 Prism незаметно изменяются в течение дня в зависимости от времени суток, уровня заряда батареи и силы сигнала. Таким образом, каждый раз вы видите на дисплее телефона уникальное изображение. Необычный телефон обладает 49 вариантами цветов подсветки дисплея и клавиатуры. Nokia 7900 Prism способен работать в 3G сетях, обладает 2-мегапиксельной камерой и 1 Гигабайтом внутренней памяти.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nЭффектный имиджевый телефон качественная сборка, отличный дисплей, 1 Гб встроенной памяти, наличие световых индиктаторов заставят вас и окружающих восхищаться этим по истине прекрасным телефоном.<br />\r\n<br />\r\n<br />\r\n<br />\r\n&nbsp;',76,'2200.00','1','1','2009-06-05 18:17:22','Nokia 7900 black','Nokia 7900 black','Nokia 7900 black','Nokia 7900 black','nokia-7900-black-','','','',16),(77,1,3,1,'Nokia 7610 Gunmetal','<strong>Описание:</strong><br />\r\nДля слайдера Nokia 7610 Supernova предлагаются сменные панели Xpress-On голубого, красного, серого, лилового и белого цветов. Интересна функция Theme Colorizer, когда в зависимости от установленной темы меняется подсветка клавиш. Снимает аппарат 3,2-мегапиксельной камерой со светодиодной вспышкой, 8-кратным цифровым зумом. На телефоне есть дополнительные музыкальные клавиши, пользователя будут развлекать радио, МР3 плеер. Услуга Nokia WidSets позволит размещать контент на любимых сайтах непосредственно с телефона.<br />\r\n<strong><br />\r\nДостоинства:</strong><br />\r\nNokia 7610 Supernova является симпатичным компактным слайдером с красочным дизайном. Полагаем, что основная целевая аудитория назовет его забавным и компактным. А молодежь найдет в нем много занимательных функций, направленных на улучшения основной детали телефона &ndash; дизайна. Жизнь &ndash; это буйство красок, и Nokia 7610 Supernova этому пример.&nbsp;',77,'1930.00','1','1','2009-06-05 18:17:23','Nokia 7610 Gunmetal','Nokia 7610 Gunmetal','Nokia 7610 Gunmetal','Nokia 7610 Gunmetal','nokia-7610-gunmetal-','','','',27),(78,1,3,1,'Nokia 7610 White','<strong>Описание:</strong><br />\r\nДля слайдера Nokia 7610 Supernova предлагаются сменные панели Xpress-On голубого, красного, серого, лилового и белого цветов. Интересна функция Theme Colorizer, когда в зависимости от установленной темы меняется подсветка клавиш. Снимает аппарат 3,2-мегапиксельной камерой со светодиодной вспышкой, 8-кратным цифровым зумом. На телефоне есть дополнительные музыкальные клавиши, пользователя будут развлекать радио, МР3 плеер. Услуга Nokia WidSets позволит размещать контент на любимых сайтах непосредственно с телефона.<br />\r\n<strong><br />\r\nДостоинства:</strong><br />\r\nNokia 7610 Supernova является симпатичным компактным слайдером с красочным дизайном. Полагаем, что основная целевая аудитория назовет его забавным и компактным. А молодежь найдет в нем много занимательных функций, направленных на улучшения основной детали телефона &ndash; дизайна. Жизнь &ndash; это буйство красок, и Nokia 7610 Supernova этому пример.<br />\r\n<br />',78,'2050.00','1','1','2009-06-05 18:17:23','Nokia 7610 White','Nokia 7610 White','Nokia 7610 White','Nokia 7610 White','nokia-7610-white-','','','',21),(79,1,3,1,'Nokia 7510 brown-blue','<strong>Описание:</strong><br />\r\nДля быстрого раскрытия раскладушка Nokia 7510 Supernova имеет кнопку на боку. Для этой модели доступны сменные панели Xpress-On цветов красного, голубого, зеленого и коричневого. Аппарат красиво подсвечивается при помощи спрятанного снаружи дисплея. Корпус 7510 посажен на металлический шарнир, а само покрытие телефона мягкое и приятное на ощупь. В раскладушке реализована 2-мегапиксельная камера со вспышкой,2,2-дюймовый  дисплей,Радио, плеер,  доступ к Nokia Maps 1.2, поддержка A-GPS и Nokia WidSets. <br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nРаскладушка Nokia 7510 Supernova &ndash; яркий, смелый, стильный телефон, который может привлечь не только своим оригинальным дизайном, но и оптимальным набором функций. Благодаря своей более спокойной расцветке, он становится желанным для любого круга пользователей.<br />',79,'1950.00','1','1','2009-06-05 18:17:23','Nokia 7510 brown-blue','Nokia 7510 brown-blue','Nokia 7510 brown-blue','Nokia 7510 brown-blue','nokia-7510-brown-blue-','','','',22),(80,1,3,1,'Nokia 7100 red','<strong>Описание:</strong><br />\r\nNokia 7100 Supernova- ешё одно произведение искуства к популярной коллекции Supernova. Он создан для развлечений и отдыха. Этот имеджевый телефон выпускается в трех цветах &ndash; синем, красном, черном. Имеет достаточную функциональность. Оснащен цветным 2х дюймовым дисплеем, 1,3-мегапиксельн