ыми цветами во время разговора. На задней крышке расположен металлический логотип Emporio Armani.Помимо дизайна, стиль Armani подчеркивают специальные графический и музыкальный интерфейсы, которые позволяют разместить на экране логотип Emporio Armani и установить фирменную мелодию рингтона. Телефон Night Effect является по-настоящему музыкальным &mdash; множество музыкальных функций, клавиша управления музыкой и FM-радио обеспечат пользователю качественный звук.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nSamsung M7500 Emporio Armani Night Effect&ndash; модная легкая и оригинальная модель. Телефон сможет ярко выразить вашу индивидуальность, и внести в жизнь больше красок, разнообразив ее своим хорошим потенциалом.',99,'2680.00','1','1','2009-06-05 18:17:23','Samsung M7500 Emporio Armani','Samsung M7500 Emporio Armani','Samsung M7500 Emporio Armani','Samsung M7500 Emporio Armani','samsung-m7500','','','',12),(100,1,4,1,'Samsung D-980 black','<strong>Описание:</strong><br />\r\nSamsung D980 - аппарат, поддерживающий работу двух SIM-карт одновременно. Телефон оборудован сенсорным экраном с фирменным интерфейсом TouchWiz .Мультимедийная составляющая представлена 5-мегапиксельной камерой с автофокусом и вспышкой, аудио и видео плеерами, поддержкой виджетов, радио. В аппарате применяеться аккумулятор повышенной емкости, что позволит оставаться на связи еще дольше.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nУдобным пользовательский интерфейс и поддержка двух SIM-карт станет отличным выбором для занятых людей, которые много путешествуют или часто пользуются мобильным интернетом.',100,'3950.00','1','1','2009-06-05 18:17:23','Samsung D-980 black','Samsung D-980 black','Samsung D-980 black','Samsung D-980 black','samsung-d-980-black','','','',23),(101,1,4,1,'Samsung S3600 silver','<strong>Описание:</strong><br />\r\nТонкий, полированный S3600 выделяется исключительным стилем. Изящный корпус с отделкой текстурированного металла. Внутри этого мобильного телефона открывается полный спектр функций, удовлетворяющий вашим потребностям в области связи, мультимедиа, общения и безопасности. Первоклассная функциональность в элегантом воплощении - этот телефон изумителен со всех сторон.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nSamsung GT-S3600 - это мобильный телефон, ориентирован на все слои населения, которые хотят обладать простым, но стильным телефоном. Эта раскладушка не имеет внешнего дисплея, но зато в наличии функция Mobile Tracker 1.0, благодаря которой можно сохранить конфиденциальность персональных данных в случае кражи или утери телефона.',101,'1290.00','1','1','2009-06-05 18:17:23','Samsung S3600 silver','Samsung S3600 silver','Samsung S3600 silver','Samsung S3600 silver','samsung-s3600-silver','','','',17),(102,1,4,1,'Samsung E1100 Black','<strong>Описание:</strong><br />\r\nКорпус модели Samsung Е1100 отличается менее строгим, молодежным дизайном. Этот аппарат имеет встроенный фонарик, который будет уместен во множестве ситуаций &mdash; от открывания двери в темном подъезде до туристического похода<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nХороший телефон с необходимым набором функций по очень доступной цене.',102,'350.00','1','1','2009-06-05 18:17:23','Samsung E1100 Black','Samsung E1100 Black','Samsung E1100 Black','Samsung E1100 Black','samsung-e1100-black','','','',20),(103,1,4,1,'Samsung E1310 black','<strong>Описание:</strong><br />\r\nМодель E1310 &mdash; это великолепный мобильный компаньон, отвечающий вашим требованиям к связи. Он не только оснащен необходимыми функциями, включая FM-радио и возможности безопасности, но и привлекает взгляд компактными размерами и стильным дизайном. Это телефон отвечает основным требованиям и не содержит ничего лишнего.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nЭргономичный корпус, Компактные размеры, FM-радио и очень интересные функции: оповещения о смене SIM-карты и&nbsp; Ложный вызов. <br />',103,'590.00','1','1','2009-06-05 18:17:23','Samsung E1310 black','Samsung E1310 black','Samsung E1310 black','Samsung E1310 black','samsung-e1310-black','','','',23),(104,1,4,1,'Samsung E1310 red','<strong>Описание:</strong><br />\r\nМодель E1310 &mdash; это великолепный мобильный компаньон, отвечающий вашим требованиям к связи. Он не только оснащен необходимыми функциями, включая FM-радио и возможности безопасности, но и привлекает взгляд компактными размерами и стильным дизайном. Это телефон отвечает основным требованиям и не содержит ничего лишнего.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nЭргономичный корпус, Компактные размеры, FM-радио и очень интересные функции: оповещения о смене SIM-карты и&nbsp; Ложный вызов.',104,'590.00','1','1','2009-06-05 18:17:23','Samsung E1310 red','Samsung E1310 red','Samsung E1310 red','Samsung E1310 red','samsung-e1310-red','','','',21),(105,1,4,1,'Samsung S8300','<strong>Описание:</strong><br />\r\nТелефон оснащен сенсорным AMOLED-дисплеем с диагональю 2,8 дюйма, обеспечивающим исключительную яркость и насыщенность цветов. Тонкий (12,7 мм) корпус аппарата облачен в металлическую рамку и оснащен полированной задней крышкой, что придает UltraTOUCH изысканный вид. Встроенная камера 8 Мпикс, LED-вспышка и функция распознавания улыбки позволяют делать фотографии очень высокого качества. Также пользователю доступны виджеты, уже ставшие визитной карточкой телефонов Samsung. В дополнение к камере, UltraTOUCH оснащается GPS-модулем, который обеспечивает точную навигацию, а функция гео-тегинга позволяет делать фотографии с привязкой к географическим координатам. Качественная запись VGA-видео со скоростью 30 кадров в секунду и музыкальный плеер дополняют набор мультимедийных функций. Для уверенной и быстрой работы в сети UltraTOUCH оснащен поддержкой протокола HSDPA 7,2 Мбит/с.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nСлияние инновационных технологий и искусства рождает совершенство &mdash; новый ультратонкий S8300 Ultra Touch. Этот телефон уникален не только снаружи, но и внутри. Богатый функционал, последние разработки и технологии предоставляют Вам неограниченные возможности как в развлечениях, так и в работе.',105,'4200.00','1','1','2009-06-05 18:17:23','Samsung S8300','Samsung S8300','Samsung S8300','Samsung S8300','samsung-s8300','','','',16),(106,1,4,1,'Samsung C5212 Black','<strong>Описание:</strong><br />\r\nSamsung C5212 при своей доступной цене оснащен не только востребованной и популярной технологией поддержки двух SIM-карт, но и целым набором функций. Несмотря на невысокую стоимость, телефон выглядит весьма презентабельно, он выполнен в формфакторе моноблока и практически полностью окрашен в черный цвет. Для переключения между картами реализована отдельная кнопка. С SIM-карт можно не только звонить и писать SMS, но и выходить в Интернет. Для каждой SIM-карты можно установить собственную персонализацию в виде названия, иконки и мелодий, также в аппарате реализована возможность переноса записной книжки и других данных с одной SIM-карты на другую.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nSamsung C5212, поддерживающий одновременную работу двух SIM-карт &mdash; это сразу два телефона в одном. Вы можете легко отделить рабочие контакты от личных, выбрать более выгодный тарифный план, экономить на роуминге. Плюс, в стильном глянцевом корпусе телефона Samsung C5212 сочетаются удобство и широкий выбор мультимедийных функций.',106,'1610.00','1','1','2009-06-05 18:17:23','Samsung C5212 Black','Samsung C5212 Black','Samsung C5212 Black','Samsung C5212 Black','samsung-c5212-black','','','',16),(107,1,4,1,'Samsung E1125 silver','<strong>Описание:</strong><br />\r\nУдобный телефон E1125 являет собой воплощение доступности и классического стиля. Металлические элементы корпуса делают его простым и надежным. Большой и яркий ЖК-дисплей (CSTN) с диагональю 3,9 см отображает 65 тыс. цветов. Диспетчер вызовов и функция ограничения длительности разговора позволяют контролировать вр