0i','sony-ericsson-k-800i','','','',24),(133,1,5,1,'Sony-Ericsson K 810i red','<strong>Описание:</strong><br />\r\nSony Ericsson К810i предназначен для тех, кто постоянно использует свой мобильный телефон для того, чтобы делать качественные снимки в дороге или в движении. Утонченный дизайн скрывает большие возможности - поддержка UMTS, а также имеющий в своем арсенале множество мультимедийных функций: 3D игры, стерео воспроизведение mp3 файлов, FM-радио, диктофон, офисные приложения и возможность работать с Интернетом.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nЭлегантный дизайн и огромная функциональность делают Sony Ericsson К810i не заменимым как для работы так и для развлечений.',133,'1400.00','1','1','2009-06-05 18:17:23','Sony-Ericsson K 810i red','Sony-Ericsson K 810i red','Sony-Ericsson K 810i red','Sony-Ericsson K 810i red','sony-ericsson-k-810i-red','','','',18),(134,1,5,1,'Sony-Ericsson K 850','<strong>Описание:</strong><br />\r\nАвтомат. крышка объектива. Автофокус для четкости, ксеноновая вспышка для слабой освещенности. Иными словами, все необходимое для идеального снимка. Телефон K850i Cyber-shot настоящая цифровая фотокамера &ndash; в вашем распоряжении 5 мегапикселей. С помощью BestPic&trade; трудно сделать плохой снимок. Девять фотографий подряд. Сохраните понравившуюся. А плохое изображение можно улучшить с Photo fix. Наслаждайтесь своими фотографиями на ярком кристаллическом дисплее. Или поделитесь - отправьте свои фотографии в свой блог, чтобы их могли увидеть все.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nSony Ericsson K850i порадует даже самых привередливых поклонников &laquo;умных телефонов&raquo; потому как, кроме всех перечисленных достоинств и преимуществ, он обладает просто фантастическими звуковыми качествами, как при мобильной связи, так и при прослушивании ваших любимых треков.',134,'1850.00','1','1','2009-06-05 18:17:23','Sony-Ericsson K 850','Sony-Ericsson K 850','Sony-Ericsson K 850','Sony-Ericsson K 8