ещает вас по текущему плейлисту. Shake control открывает новые возможности для мобильных игр. Слайдер Sony Ericsson W910i снимает 2-мегапиксельной камерой, также оснащен фронтальной камерой, TFT дисплеем в 2,4 дюйма , стерео Bluetooth, и FM радио.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nОтличный слайдер с огромным экраном и отличным плеером,который управляется при помощи простого встряхивания телефона.',159,'1690.00','1','1','2009-06-05 18:17:23','Sony-Ericsson W910 silver','Sony-Ericsson W910 silver','Sony-Ericsson W910 silver','Sony-Ericsson W910 silver','sony-ericsson-w910-silver','','','',11),(160,1,5,1,'Sony-Ericsson W980 black','<strong>Описание:</strong><br />\r\nSony Ericsson W980 - музыкальный представитель Walkman линейки, выделяющийся своим необычным дизайном. На передней панеле раскладушки расположены&nbsp; дисплей и клавиши управления плеером. Не смотря на то, что телефон музыкальный, он оснащен мощной и современной камерой в 3 мегапикселя, а так же второй камерой для осуществления видеозвонков, благодаря поддержке 3G. Слота для карт памяти в Sony Ericsson W980 нет, но встроенных 8 Гигабайт в телефоне с головой хватит и для музыки и для фотографий и для приложений. Еще одной уникальной и интересной функцией является FM передатчик, при помощи которого можно передавать музыку с MP3 плеера телефона на любой FM приемник, что очень удобно в машине или дома.<br />\r\n<strong><br />\r\nДостоинства:</strong><br />\r\nУдобный МР3- плеер и телефон в одном устройстве. Насыщенные басы, улучшенное качество стереозвука - ни с чем не сравнимые ощущения. <br />',160,'2650.00','1','1','2009-06-05 18:17:23','Sony-Ericsson W980 black','Sony-Ericsson W980 black','Sony-Ericsson W980 black','Sony-Ericsson W980 black','sony-ericsson-w980-black','','','',12),(161,1,5,1,'Sony-Ericsson Z-250 Black','<strong>Описание:</strong><br />\r\nSony Ericsson Z250i - телефон бюджетного класса, выполненный в форм-факторе раскладушка, обладающий оригинальным дизайном, 0,3-мегапиксельной камерой и редактором изображений.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nМодель бюджетного класса оснащена&nbsp; 0,3-мегапиксельной камерой, и главная изюминка которой в оригинальном внешнем дисплее и приятных узорах.',161,'470.00','1','1','2009-06-05 18:17:23','Sony-Ericsson Z-250 Black','Sony-Ericsson Z-250 Black','Sony-Ericsson Z-250 Black','Sony-Ericsson Z-250 Black','sony-ericsson-z-250-black','','','',15),(162,1,5,1,'Sony-Ericsson Z-310i pink','<strong>Описание:</strong><br />\r\nSony Ericsson Z310 - стильный телефон, в котором сочетаются функциональность и яркий дизайн. Блестящая зеркальная полировка верхней части корпуса создает ощущение драгоценности. Cреди широкого набора возможностей Z310 есть встроенная 0.3-мегапиксельная камера и Bluetooth. <br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nУникальный дизайн и три притягивающих взгляд цвета &ndash; черный, розовый и бронзовый &ndash; это телефон, который станет вашим новым украшением.<br />',162,'535.00','1','1','2009-06-05 18:17:23','Sony-Ericsson Z-310i pink','Sony-Ericsson Z-310i pink','Sony-Ericsson Z-310i pink','Sony-Ericsson Z-310i pink','sony-ericsson-z-310i-pink','','','',15),(163,1,5,1,'Sony-Ericsson Z-320 blue','<strong>Описание:</strong><br />\r\nВ &quot;раскладушке&quot; Z320 акцент сделан на дизайне. Представьте себе телефон с раскладным корпусом и встроенной камерой, который был создан с расчётом на простоту использования. Добавьте чистые линии, классический дизайн и чуть-чуть ретро. Вы получите... Z320i.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nSony Ericsson Z320i - бюджетная раскладушка выполненная в имиджевом стиле, с камерой и МР3 мелодиями.',163,'660.00','1','1','2009-06-05 18:17:23','Sony-Ericsson Z-320 blue','Sony-Ericsson Z-320 blue','Sony-Ericsson Z-320 blue','Sony-Ericsson Z-320 blue','sony-ericsson-z-320-blue','','','',14),(164,1,5,1,'Sony-Ericsson Z-555 black','<strong>Описание:</strong><br />\r\nИмиджевая раскладушка Z555 отличается новым &quot;бриллиантовым&quot; дизайном: верхняя крышка корпуса как бы состоит из множества граней. Телефон оборудован внешним OLED-дисплеем, который в выключенном состоянии не заметен на крышке. В качестве одной из основных функциональных особенностей устройства производитель отмечает возможность управления жестами - для выключения входящего звонка или сработавшего будильника достаточно провести рукой над телефоном.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nЭлегантная раскладушка Sony Ericsson Z555i удивительным образом сочетает в себе серьезный функциональный набор с инновационным &quot;бриллиантовым&quot; дизайном.',164,'925.00','1','1','2009-06-05 18:17:23','Sony-Ericsson Z-555 black','Sony-Ericsson Z-555 black','Sony-Ericsson Z-555 black','Sony-Ericsson Z-555 black','sony-ericsson-z-555-black','','','',15),(165,1,5,1,'Sony-Ericsson Z-555 red','<strong>Описание:</strong><br />\r\nИмиджевая раскладушка Z555 отличается новым &quot;бриллиантовым&quot; дизайном: верхняя крышка корпуса как бы состоит из множества граней. Телефон оборудован внешним OLED-дисплеем, который в выключенном состоянии не заметен на крышке. В качестве одной из основных функциональных особенностей устройства производитель отмечает возможность управления жестами - для выключения входящего звонка или сработавшего будильника достаточно провести рукой над телефоном.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nЭлегантная раскладушка Sony Ericsson Z555i удивительным образом сочетает в себе серьезный функциональный набор с инновационным &quot;бриллиантовым&quot; дизайном.',165,'925.00','1','1','2009-06-05 18:17:23','Sony-Ericsson Z-555 red','Sony-Ericsson Z-555 red','Sony-Ericsson Z-555 red','Sony-Ericsson Z-555 red','sony-ericsson-z-555-red','','','',25),(166,1,5,1,'Sony-Ericsson Z-750 Purple','<strong>Описание:</strong><br />\r\nSony Ericsson Z750 - первый аппарат компании с поддержкой стандарта HSDPA, работающий в сетях третьего поколения. Sony Ericsson Z750 оснащен 2-мегапиксельной камерой, качественным MP3 плеером, FM приемником и множеством вспомогательных и развлекательных приложений.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nОтличная раскладушка с полным набором функций и поддержкой HSDPA, плюс ко всему замечательный дизайн и хорошая эргономика.',166,'1690.00','1','1','2009-06-05 18:17:23','Sony-Ericsson Z-750 Purple','Sony-Ericsson Z-750 Purple','Sony-Ericsson Z-750 Purple','Sony-Ericsson Z-750 Purple','sony-ericsson-z-750-purple','','','',15),(167,1,5,1,'Sony-Ericsson Z-770 black','<strong>Описание:</strong><br />\r\nСкорость, мощность и элегантность сочетаются в телефоне SonyEricsson Z770i. Этотраскладной телефон поддерживает технологию HSDPA, самую быструютехнологию передачи данных.Телефон SonyEricsson Z770i обеспечивает легкий доступ к вашему электронному почтовому ящику. Где бы вы ни находились, вы будете получать почту прямо на телефон.Раскрытый аппарат порадует любителей больших экранов. Огромная панель смотрит на вас с верхней створки. Внизу разместилась плоская клавиатура. Выглядит это чудо очень стильно, и большинство пользователей просто запищит от восторга.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nТелефон Sony Ericsson Z770i может понравиться многим. Потенциальная аудитория телефона - молодые и успешные люди. Они будут эксплуатировать этот стильный аппарат на работе и с удовольствием брать его на тусовки.',167,'1350.00','1','1','2009-06-05 18:17:23','Sony-Ericsson Z-770 black','Sony-Ericsson Z-770 black','Sony-Ericsson Z-770 black','Sony-Ericsson Z-770 black','sony-ericsson-z-770-black','','','',14),(168,1,5,1,'Sony-Ericsson Z-770 red','<strong>Описание:</strong><br />\r\nСкорость, мощность и элегантность сочетаются в телефоне SonyEricsson Z770i. Этотраскладной телефон поддерживает технологию HSDPA, самую быструютехнологию передачи данных.Телефон SonyEricsson Z770i обеспечивает легкий доступ к вашему электронному почтовому ящику. Где бы вы ни находились, вы будете получать почту прямо на телефон.Раскрытый аппарат порадует любителей больших экранов. Огромная панель смотрит на вас с верхней створки. Внизу разместилась плоская клавиатура. Выглядит это чудо очень стильно, и большинство пользователей просто запищит от восторга.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nТелефон Sony Ericsson Z770i может понравиться многим. Потенциальная аудитория телефона - молодые и успешные люди. Они будут эксплуатировать этот стильный аппарат на работе и с удовольствием брать его на тусовки.',168,'1695.00','1','1','2009-06-05 18:17:23','Sony-Ericsson Z-770 red','Sony-Ericsson Z-770 red','Sony-Ericsson Z-770 red','Sony-Ericsson Z-770 red','sony-ericsson-z-770-red','','','',11),(169,1,5,1,'Sony-Ericsson С 702 black','<strong>Описание:</strong><br />\r\nSony Ericsson C702 относится к разряду устройств в которых совмещены два фактора: хорошая фотокамера и защищенный корпус. Sony Ericsson C702 - идеальный камерофон для поездок на природу, который не страшно уронить на песок, ему ничего не случится при попадании капель дождя, а при необходимости пользователь сможет запечатлеть хороший снимок с 3,2-мегапиксельной камерой, которой можно управлять одной рукой, поэтому вы можете делать снимки из любого положения.А встроеная функция A-GPS и Служба Google Maps&trade; Mobile поможет вам всегда найти дорогу.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nОснащенный высокотехнологичной 3-мегапиксельной камерой, Sony Ericsson C702i готов снимать в любое время, будь-то день или ночь, помещение или улица, а устойчивость телефона к пыли и влаге прекрасно подойдет людям, которые ведут активный образ жизни.',169,'1750.00','1','1','2009-06-05 18:17:23','Sony-Ericsson С 702 black','Sony-Ericsson С 702 black','Sony-Ericsson С 702 black','Sony-Ericsson С 702 black','sony-ericsson-s-702-black','','','',12),(170,1,5,1,'Sony-Ericsson С 902 black','<strong>Описание:</strong><br />\r\nSony Ericsson C902 создан специально для отличных снимков. Сдвигающаяся крышка объектива активирует 5-мегапиксельную камеру. Сделайте нужные настройки с помощью сенсорных кнопок на дисплее. Если на фотографии есть люди, активируйте функцию распознавания лиц. Ваш C902 автоматически найдёт людей и сфокусируется на их лицах. Пусть вас не тревожит плохое освещение. При необходимости автоматически включается фотовспышка. Вспышку можно использовать в режиме BestPic&trade;, а также для снятия видеороликов. <br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nSony Ericsson C902 - это действительно сбалансированное, интересное решение, икона стиля среди фотографических устройств. Высокое качество материалов и сборки, применение металла, минимальные габариты, отличный дизайн и, пожалуй, наиболее удобное управление в режиме съемки являются уникальными чертами С902.',170,'2600.00','1','1','2009-06-05 18:17:23','Sony-Ericsson С 902 black','Sony-Ericsson С 902 black','Sony-Ericsson С 902 black','Sony-Ericsson С 902 black','sony-ericsson-s-902-black','','','',14),(171,1,5,1,'Sony-Ericsson С 905 black','<strong>Описание:</strong><br />\r\nКамера Sony Ericsson C905 просто на высоте: она не оставит вас безразличным, настроек и функций очень много. C905 Cyber-shot получил 8,1-мегапиксельную камеру, снащен ксеноновой вспышкой и всегда готов запечатлеть лучшие моменты вашей жизни. C905 обладает всем необходимым для съемки идеальных фотографий. Smart Contrast настраивает уровень света и цвета. Функция распознавания лица помогает фокусироваться на людях. Благодаря C905 у вас есть свой проводник: ваш телефон оборудован встроенной системой aGPS и службой Google Maps которая поможет вам найти дорогу.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nSony Ericsson C905 - это навигационный бизнес-камерафон, является флагманом линейки Cyber-shot. Вобрал в себя все необходимое для современной жизни, отличную камеру, быстрый интернет, поддержку большинства коммуникационных стандартов (включая Wi-Fi и GPS) и полон мультимедийности. <br />',171,'4050.00','1','1','2009-06-05 18:17:23','Sony-Ericsson С 905 black','Sony-Ericsson С 905 black','Sony-Ericsson С 905 black','Sony-Ericsson С 905 black','sony-ericsson-s-905-black','','','',14),(172,1,7,1,'Bluetooth Nokia BH 209','<strong>Описание:</strong><br />\r\nNokia BH-209 - новинка выдержанная в строгом классическом дизайне. Nokia BH-209 необычайно удобна и легка, производитель позиционирует ее как чисто мужскую модель, для людей которые ценят удобство и качество.<br />\r\nОбладая такими размерами, она станет отличным выбором для деловых солидных людей. Новинка поддерживает Bluetooth версии 2.0 + EDR, и профиль Handsfree Profiles 1.5 и 1.1. Гарнитура имеет  улучшенное качество звука и отличное качество передачи речи.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nNokia BH-209 подчеркнет ваш стиль делового человека.<br />\r\n<br />\r\n<strong>Поддерживаемые специальные функции:</strong><br />\r\n- Ответить/закончить разговор<br />\r\n- Ожидание/удержание вызова<br />\r\n- Голосовой набор<br />\r\n- Повтор последнего номера<br />\r\n- Дополнительные функции:&nbsp;<br />\r\n&nbsp; индикатор состояния&nbsp;<br />\r\n&nbsp; Регулируемый наушник - удобно носить на любом ухе&nbsp;<br />\r\n<br />\r\n<strong>Комплектация Nokia BH-209:</strong><br />\r\nBluetooth-гарнитура Nokia BH-209<br />\r\nЗарядное устройство Nokia AC-3Е<br />\r\nНасадка на ухо<br />\r\nРуководство пользователя&nbsp;<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n&nbsp;',173,'310.00','1','1','2009-06-05 18:17:23','Bluetooth Nokia BH 209','Bluetooth Nokia BH 209','Bluetooth Nokia BH 209','Bluetooth Nokia BH 209','bluetooth-nokia-bh-209-','','','',23),(173,1,7,1,'Bluetooth Nokia BH 212','<strong>Описание:</strong><br />\r\nКомпания Nokia представила новую беспроводную гарнитуру Nokia BH-212. Новинка совместима со всеми телефонами.Практичная и удобная гарнитура с базовым набором функций. Эргономичность дизайна и удобная заушина способствуют сохранению комфорта во время длительного разговора.Заявленное время автономной работы в режиме разговора составляет 11 часов. Проще говоря, одного заряда батареи хватит даже на очень длинный рабочий день, максимально перегруженный телефонными разговорами.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nПоражает сочетанием интересного дизайна и нетрадиционной дужки, и долгой работой аккумулятора и простотой в управлении.<br />\r\n<br />\r\n<strong>Поддерживаемые специальные функции:</strong><br />\r\n- Ответить/закончить разговор<br />\r\n- Ожидание/удержание вызова<br />\r\n- Голосовой набор<br />\r\n- Повтор последнего номера<br />\r\n- Дополнительные функции: <br />\r\n&nbsp;  индикатор состояния <br />\r\n&nbsp; Специальное U-образное крепление - удобно носить на любом ухе <br />\r\n<br />\r\n<strong>Комплект поставки:</strong><br />\r\n&nbsp;   * Bluetooth гарнитура Nokia BH-212<br />\r\n&nbsp;   * Компактное зарядное устройство Nokia АС-3Е <br />\r\n&nbsp;   * Руководство пользователя<br />\r\n<br />\r\n&nbsp;',174,'310.00','1','1','2009-06-05 18:17:23','Bluetooth Nokia BH 212','Bluetooth Nokia BH 212','Bluetooth Nokia BH 212','Bluetooth Nokia BH 212','bluetooth-nokia-bh-212-','','','',28),(174,1,7,1,'Bluetooth Nokia BH 803','<strong>Описание:</strong><br />\r\nNokia BH-803 - интересная новинка компании Nokia из класса &quot;Премиум&quot;. Внешне Nokia BH-803 напоминает элегантный брусок. Выполнена Nokia BH-803 из пластика и стали. Гарнитуру Nokia BH-803 можно носить двумя способами - просто вставив в ухо или сделать то же самое, но с дужкой. Дужка вставляется в специальный паз, она тонкая, невесомая, сделана, из металла, можно не бояться ее сломать. Nokia BH-803 имеет одну кнопка управляющую приемом вызовов и сенсорную площадку на передней панели (проводя пальцем к уху, вы увеличиваете громкость, делая наоборот - уменьшаете).<br />\r\nNokia BH-803 дополняется высококачественным звуком с технологией цифровой обработки сигнала (DSP), помогающей убрать фоновые звуки.<br />\r\nМалый вес (11 г), компактный размер и быстрая зарядка делает Bluetooth-гарнитуру Nokia BH-803 безупречным дополнением вашего мобильного стиля жизни.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nИмиджевая гарнитура выполнена в оригинальном дизайне. Идеальное решение для молодых и стильных людей.<br />\r\n<br />\r\n<strong>Поддерживаемые специальные функции:</strong><br />\r\n- Ответить/закончить разговор<br />\r\n- Ожидание/удержание вызова<br />\r\n- Голосовой набор<br />\r\n- Повтор последнего номера<br />\r\n- Дополнительные функции: <br />\r\n&nbsp; индикатор состояния <br />\r\n&nbsp; Регулируемый наушник - удобно носить на любом ухе <br />\r\n&nbsp; Сенсорные клавиши регулировки звука<br />\r\n<br />\r\n<strong>Комплектация Nokia BH-803:</strong><br />\r\nBluetooth-гарнитура Nokia BH-803<br />\r\nЗарядное устройство Nokia AC-6<br />\r\nКлипса<br />\r\nРемешок для ношения на шее<br />\r\nРуководство пользователя <br />\r\n<br />\r\n&nbsp;',175,'1500.00','1','1','2009-06-05 18:17:23','Bluetooth Nokia BH 803','Bluetooth Nokia BH 803','Bluetooth Nokia BH 803','Bluetooth Nokia BH 803','bluetooth-nokia-bh-803-','','','',20),(175,1,8,1,'Bluetooth Plantronics 230','<strong>Описание:</strong><br />\r\nExplorer 230 &mdash; замечательное решение на весь день. Одной зарядки гарнитуры хватает на 8 часов работы в режиме разговора и до 9 дней - в режиме ожидания. Благодаря небольшому весу (всего 11 грамм!) и тонкому гибкому крючку, гарнитура надежно крепится на ухе и не причиняет дискомфорта при длительном ношении. Кроме того, гарнитура будет практически незаметной, её длина &mdash; всего 5 см.<br />\r\nТехнология QuickPair, используемая в новинке, позволяет максимально упростить процесс первого сопряжения гарнитуры с телефоном &mdash; при включении, Explorer 230 автоматически входит в режим сопряжения.<br />\r\nНа корпусе гарнитуры расположены удобные кнопки управления вызовами и регулировки громкости, а также световой индикатор, сигнализирующий о пропущенных вызовах и низком заряде аккумулятора.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nМолодежный,стильный,умный,доступный в цене, новый Plantronics - Explorer 230<br />\r\n<br />\r\n<strong>Поддерживаемые специальные функции:</strong><br />\r\n- Ответить/закончить разговор<br />\r\n- Ожидание/удержание вызова<br />\r\n- Голосовой набор<br />\r\n- Повтор последнего номера<br />\r\n- Дополнительные функции:&nbsp;<br />\r\n&nbsp; индикатор состояния&nbsp;<br />\r\n&nbsp; Регулируемый наушник - удобно носить на любом ухе&nbsp;<br />\r\n&nbsp; Технология QuickPair<br />\r\n<br />\r\n<br />\r\n<strong>Комплектация Plantronics Explorer 230:</strong><br />\r\n- Гарнитура<br />\r\n- Зарядное устройство (с разьёмом MicroUSB)<br />\r\n- Инструкция на русском языке<br />\r\n<br />\r\n<br />',176,'260.00','1','1','2009-06-05 18:17:23','Bluetooth Plantronics 230','Bluetooth Plantronics 230','Bluetooth Plantronics 230','Bluetooth Plantronics 230','bluetooth-plantronics-230-','','','',17),(176,1,8,1,'Bluetooth Plantronics 650 Discovery','<strong>Описание:</strong><br />\r\nГарнитура Discovery 650 представляет собой прекрасное решение для людей, активно использующих несколько Bluetooth-устройств. Гарнитура Plantronics DISCOVERY 650 оснащена функцией Multipoint, позволяющей одной гарнитуре работать с двумя Bluetooth-устройствами одновременно и контролировать вызовы с обоих устройств.<br />\r\nСпециально разработанная автономная система зарядки позволяет заряжать Plantronics Discovery 650 от батарейки или аккумулятора типа ААА. В комплект поставки Plantronics Discovery 650 входит зарядный стакан, адаптер для батарейки и батарейка. Зарядный стаканчик Plantronics Discovery 650 оснащен встроенным вибровызовом. Кроме того, когда при входящем звонке вы вынимаете Plantronics Discovery 650 из стаканчика, вам не нужно нажимать клавишу принятия вызова, гарнитура примет звонок автоматически! <br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nБлагодаря широкой комплектации и удобному креплению гарнитуры на ухе.Plantronics Discovery 650 - Прекрасное решение для активных людей,находящихся постоянно в движении и не имеющих возможности частого заряда устройства от сети.<br />\r\n<br />\r\n<strong>Поддерживаемые специальные функции:</strong><br />\r\n- Ответить/закончить разговор<br />\r\n- Ожидание/удержание вызова<br />\r\n- Голосовой набор<br />\r\n- Повтор последнего номера<br />\r\n- Дополнительные функции: <br />\r\n&nbsp; индикатор состояния <br />\r\n&nbsp; Регулируемый наушник - удобно носить на любом ухе <br />\r\n&nbsp; Технология QuickPair/Multipoint<br />\r\n<br />\r\n<strong>Комплектация Plantronics Discovery 650:</strong><br />\r\nBluetooth-гарнитура Plantronics Discovery 650<br />\r\nЗарядное устройство<br />\r\nАдаптер для зарядки от батарейки ААА<br />\r\nБатарейка AAA<br />\r\nЗарядный стаканчик<br />\r\nКомплект подушечек для динамика разных размеров (3 шт.)<br />\r\nУшной крючок<br />\r\nРуководство пользователя <br />\r\n<br />\r\n&nbsp;',177,'410.00','1','1','2009-06-05 18:17:23','Bluetooth Plantronics 650 Discovery','Bluetooth Plantronics 650 Discovery','Bluetooth Plantronics 650 Discovery','Bluetooth Plantronics 650 Discovery','bluetooth-plantronics-650-discovery-','','','',33),(177,1,8,1,'Bluetooth Plantronics 665 Discovery','<strong>Описание:</strong><br />\r\nГарнитура Discovery 665 &ndash; первая гарнитура Plantronics, в которой используется технология AudioIQ&reg;, созданная на основе встроенного DSP-процессора. AudioIQ&reg; автоматически адаптирует входящий звуковой поток, учитывая фоновые шумы, улучшает его качество, чистоту и настраивает оптимальный уровень громкости. В исходящем звуковом потоке Plantronics Discovery 665 AudioIQ&reg; снижает уровень фоновых шумов до 50%. Кроме того в Plantronics Discovery 665 , минимизируются искажения речи собеседника, и обеспечивается высочайшая ясность звука. Таким образом, AudioIQ&reg; значительно повышает качество звука как для говорящего, так и для его собеседника. <br />\r\nDiscovery&trade; 665 идеально подходит для автомобилистов.Компания Plantronics разработала уникальную автомобильную систему зарядки гарнитуры, включающую также световой индикатор вызова, который находится в зарядном стакане.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nPlantronics Discovery 665- очень удобная, легкая гарнитура с полным комплетом для заряда в автомобиле. Идеальное решение для людей, которые много времени проводят за рулем,в дальних поездках. &nbsp;<br />\r\n<br />\r\n<br />\r\n<strong>Поддерживаемые специальные функции:</strong><br />\r\n- Ответить/закончить разговор<br />\r\n- Ожидание/удержание вызова<br />\r\n- Голосовой набор<br />\r\n- Повтор последнего номера<br />\r\n- Дополнительные функции:&nbsp;<br />\r\n&nbsp; индикатор состояния&nbsp;<br />\r\n&nbsp; Регулируемый наушник - удобно носить на любом ухе&nbsp;<br />\r\n&nbsp; Технология QuickPair/AudioIQ&reg;<br />\r\n<br />\r\n<strong>Комплектация Plantronics Discovery 665:</strong><br />\r\nBluetooth-гарнитура Plantronics Discovery 665<br />\r\nЗарядное устройство<br />\r\nУникальная автомобильная зарядная система<br />\r\nЗарядный стаканчик<br />\r\nUSB зарядное устройство<br />\r\nКомплект подушечек для динамика разных размеров (3 шт.)<br />\r\nУшной крючок<br />\r\nРуководство пользователя&nbsp;<br />\r\n<br />\r\n<br />',178,'820.00','1','1','2009-06-05 18:17:23','Bluetooth Plantronics 665 Discovery','Bluetooth Plantronics 665 Discovery','Bluetooth Plantronics 665 Discovery','Bluetooth Plantronics 665 Discovery','bluetooth-plantronics-665-discovery-','','','',16),(178,1,8,1,'Bluetooth Plantronics 815','<strong>Описание:</strong><br />\r\nСтильная гарнитура выполнена в стиле slide-to-talk. Микрофон с системой шумоподавления расположен на выдвижном держателе, что позволяет приблизить его к губам говорящего на время разговора. Для принятия входящего вызова достаточно выдвинуть микрофон вперед, а для завершения &mdash; задвинуть его, вернув в первоначальное положение.<br />\r\nVoyager&trade; 815 оснащена технологией AudioIQ&reg;, гарантирующей превосходное качество передаваемого звука, как для вас, так и для вашего собеседника.<br />\r\nТехнология Multipoint позволяет настроить Voyager&trade; 815 на работу с двумя Bluetooth устройствам, переключаясь между ними всего лишь одним нажатием клавиши.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nVoyager 815 - прекрасная гарнитура для тех, кто пользуется несколькими средствами связи, предпочитает изящность,качественный чистый звук и особенно удобство в ношении.<br />\r\n<br />\r\n<strong>Поддерживаемые специальные функции:</strong><br />\r\n- Ответить/закончить разговор<br />\r\n- Ожидание/удержание вызова<br />\r\n- Голосовой набор<br />\r\n- Повтор последнего номера<br />\r\n&nbsp; Регулировка громкости<br />\r\n- Дополнительные функции:&nbsp;<br />\r\n&nbsp; индикатор состояния&nbsp;<br />\r\n&nbsp; Технология QuickPair/AudioIQ&reg;<br />\r\n&nbsp; Slide-to-talk дизайн &ndash; микрофон на выдвижном держателе<br />\r\n<br />\r\n<strong>Комплектация Plantronics Voyager 815:</strong><br />\r\nBluetooth-гарнитура Plantronics Voyager 815<br />\r\nЗарядное устройство<br />\r\nКомплект подушечек для динамика разных размеров (3 шт.)<br />\r\n2 съемных ушных крючка<br />\r\nРуководство пользователя&nbsp;<br />\r\n<br />\r\n<br />',179,'640.00','1','1','2009-06-05 18:17:23','Bluetooth Plantronics 815','Bluetooth Plantronics 815','Bluetooth Plantronics 815','Bluetooth Plantronics 815','bluetooth-plantronics-815-','','','',19),(179,1,8,1,'Bluetooth Plantronics 855','<strong>Описание:</strong><br />\r\nVoyager 855 &mdash; первая в своем роде Bluetooth гарнитура-трансформер. Благодаря наличию дополнительного съемного наушника, Voyager&trade; 855 может использоваться как обычная моно гарнитура с превосходным качеством звучания, или как высококачественная Bluetooth стерео гарнитура с поддержкой профиля A2DP. Для превращения моно гарнитуры в стерео, достаточно заменить обычный ушной крючок, на крючок с дополнительным динамиком, расположенным на гибком проводе. <br />\r\nBluetooth гарнитура бизнес сегмента является пополнением линейки Voyager. Устройство оснащено технологией Multipoint которая позволяет соединять гарнитуру с несколькими Bluetooth совместимыми устройствами одновременно, также стоит отметить микрофон с системой шумоподавления.<br />\r\nНа настоящий момент Voyager&trade; 855 &mdash; самая легкая Bluetooth стерео &mdash; гарнитура на рынке, ее вес &mdash; всего 15 грамм. <br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nПеред вами замечательная гарнитура-трансформер с multipoint, возможностью работы в стереорежиме, с отличным качеством передачи речи, эргономикой, и стильным дизайном в стиле slide-to-talk.<br />\r\n<br />\r\n<strong>Поддерживаемые специальные функции:</strong><br />\r\n- Ответить/закончить разговор<br />\r\n- Ожидание/удержание вызова<br />\r\n- Голосовой набор<br />\r\n- Повтор последнего номера<br />\r\n&nbsp; Регулировка громкости<br />\r\n- Дополнительные функции: <br />\r\n&nbsp; индикатор состояния <br />\r\n&nbsp; Поддержка Audio/Video, Remote Control Profile (AVRCP) <br />\r\n&nbsp; Технология QuickPair/AudioIQ&reg;<br />\r\n&nbsp; Slide-to-talk дизайн &ndash; микрофон на выдвижном держателе<br />\r\n<br />\r\n<strong>Комплектация Plantronics Voyager 855:</strong><br />\r\nBluetooth-гарнитура Plantronics Voyager 855<br />\r\nЗарядное устройство<br />\r\nДве пары насадок на динамик<br />\r\nНаушник<br />\r\nМешочек для переноски<br />\r\n2 съемных ушных крючка<br />\r\nРуководство пользователя <br />\r\n<br />\r\n&nbsp;',180,'820.00','1','1','2009-06-05 18:17:23','Bluetooth Plantronics 855','Bluetooth Plantronics 855','Bluetooth Plantronics 855','Bluetooth Plantronics 855','bluetooth-plantronics-855-','','','',19),(180,1,8,1,'Bluetooth Plantronics Discovery 925','<strong>&nbsp;Описание:</strong><br />\r\nДизайнерская гарнитрура Plantronics Discovery 925 предназначена как для мужчин, так и для женщин.<br />\r\nDiscovery 925 &ndash; самая легкая Bluetooth гарнитура в линейке Plantronics, она весит всего 8 грамм. Мягкая гелевая подушечка гарнитуры имеет специальную форму и оснащена стабилизатором, который обеспечивает надежное крепление в ухе и возможность длительного комфортного ношения гарнитуры без ушного крючка.<br />\r\nРеволюционный дизайн новинки (VFrame&trade; дизайн) позволил вынести микрофон ближе к уголку рта, обеспечив лучшую четкость звука, и сохранив при этом минимальный вес и внешнюю легкость гарнитуры.&nbsp;<br />\r\nВ гарнитуре реализована технология шумоподавления AudioIQ, позволяющая обрабатывть входящий и исходящий звуковой поток, минимизируя шумы и увеличивая четкость звука.<br />\r\nТехнология Multipoint позволяет настроить Discovery 925 на работу с двумя Bluetooth устройствам, переключаясь между ними одним нажатием клавиши.<br />\r\nГарнитура комплектуется миниатюрным кожаным футляром, снабженным дополнительным аккумулятором, позволяющим произвести одну полную подзарядку гарнитуры в отсутствии сети 220В. Футляр также удобен для хранения гарнитуры &ndash; он занимает минимум места и легко помещается в карман или сумочку.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nПревосходное качество звука в сочетании со смелым дизайном и исключительным удобством в использовании делают Discovery 925 уникальным техническим решением, не имеющим аналогов среди мобильных аксессуаров.&nbsp;<br />\r\n<br />\r\n<strong>Поддерживаемые специальные функции:</strong><br />\r\n- Ответить/закончить разговор<br />\r\n- Ожидание/удержание вызова<br />\r\n- Голосовой набор<br />\r\n- Повтор последнего номера<br />\r\n&nbsp; Регулировка громкости<br />\r\n- Дополнительные функции:&nbsp;<br />\r\n&nbsp; индикатор состояния&nbsp;<br />\r\n&nbsp; Технология QuickPair/AudioIQ&reg;<br />\r\n&nbsp;  VFrame&trade; дизайн<br />\r\n&nbsp; Четыре цветовых решения.(розовый, золотой ,черный и синий)<br />\r\n&nbsp; Возможность вкл/выкл Multipoint (значительно увеличивает время работы)<br />\r\n<br />\r\n<strong>Комплектация Plantronics Discovery 925:</strong><br />\r\nBluetooth-гарнитура Plantronics Discovery 925<br />\r\nЗарядное устройство<br />\r\nЧехол - портативное зарядное устройство, которое может обеспечить еще 5 дополнительных часов работы<br />\r\nКомплект подушечек для динамика разных размеров (3 шт.)<br />\r\nРуководство пользователя&nbsp;<br />\r\n<br />\r\n<br />',181,'840.00','1','1','2009-06-05 18:17:23','Bluetooth Plantronics Discovery 925','Bluetooth Plantronics Discovery 925','Bluetooth Plantronics Discovery 925','Bluetooth Plantronics Discovery 925','bluetooth-plantronics-discovery-925-','','','',24),(181,1,180,1,'Bluetooth Samsung wep-250','<strong>Описание:</strong><br />\r\nSamsung WEP250 это классический дизайн и высокое качество звука. Наличие Bluetooth 2.0 с поддержкой EDR гарантирует более четкое воспроизведение и передачу голоса. Стабильность связи в движении и долгое время автономной работы гарантируется.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nWEP250 и является недорогой, простой гарнитурой, именно такая вещица будет близка автомобилисту, студенту, да всем людям, которым нужна именно гарнитура, а не сосредоточение современных технологий и дизайна.<br />\r\n<br />\r\n<strong>Поддерживаемые специальные функции:</strong><br />\r\n- Ответить/закончить разговор<br />\r\n- Ожидание/удержание вызова<br />\r\n- Голосовой набор<br />\r\n- Повтор последнего номера<br />\r\n&nbsp; Регулировка громкости<br />\r\n- Дополнительные функции:&nbsp;<br />\r\n&nbsp; индикатор состояния&nbsp;<br />\r\n<br />\r\n<strong>Комплектация Samsung WEP250:</strong><br />\r\nBluetooth-гарнитура Samsung WEP250<br />\r\nЗарядное устройство<br />\r\nРуководство пользователя&nbsp;<br />\r\n<br />\r\n<br />',182,'210.00','1','1','2009-06-05 18:17:23','Bluetooth Samsung wep-250','Bluetooth Samsung wep-250','Bluetooth Samsung wep-250','Bluetooth Samsung wep-250','bluetooth-samsung-wep-250-','','','',0),(182,1,180,1,'Bluetooth Samsung wep-350','<strong>Оп</strong><strong>исание:</strong><br />\r\nИмиджевая Bluetooth гарнитура Samsung  WEP350 отличется функциональностью и компактными размерами. Это одна из самых тонких гарнитур в мире. Толщина корпуса составляет всего 5,9 мм, а вес - 7,1 грамм. Её можно носить как с заушником, так и без него. Bluetooth-гарнитура Samsung WEP350 приятна в обращении и привлекает стильным дизайном. Идеальное решение для дома и офиса. <br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nWEP350 &ndash; это просто красивая, средняя по цене гарнитура, со стандартным набором функций.<br />\r\n<strong><br />\r\nПоддерживаемые специальные функции:</strong><br />\r\n- Ответить/закончить разговор<br />\r\n- Ожидание/удержание вызова<br />\r\n- Голосовой набор<br />\r\n- Повтор последнего номера<br />\r\n&nbsp; Регулировка громкости<br />\r\n- Дополнительные функции: <br />\r\n&nbsp; индикатор состояния <br />\r\n&nbsp; Четыре цветовых решения (Черный, серебро,красный,розовый)<br />\r\n<br />\r\n<strong>Комплектация Samsung WEP350:</strong><br />\r\nBluetooth-гарнитура Samsung WEP350<br />\r\nЗарядное устройство<br />\r\nЗарядный кредл<br />\r\nРуководство пользователя <br />\r\n<br />\r\n&nbsp;',183,'360.00','1','1','2009-06-05 18:17:23','Bluetooth Samsung wep-350','Bluetooth Samsung wep-350','Bluetooth Samsung wep-350','Bluetooth Samsung wep-350','bluetooth-samsung-wep-350-','','','',2),(183,1,182,1,'Bluetooth SonyEricsson 150','<strong>Описание:</strong><br />\r\nSony Ericsson HCB-150 - оснащен системой речевого воспроизведения текста, так что устройство почти человеческим голосом сообщит, кто же посмел вас оторвать от такого увлекательного и напряженного занятия, как вождение автомобиля. При этом имя звонящего, если, конечно, он есть у вас в контактах, высветится на OLED экране устройства.<br />\r\nЧтобы ответить на звонок или отклонить вызов, вам придется нажать специальные кнопочки, которые предусмотрительно сделаны достаточно крупными.<br />\r\nБлагодаря длительному времени работы в режиме разговора и в режиме ожидания и исключительному качеству звука вы можете подолгу разговаривать в машине или любом другом месте, где вы используете комплект.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nДанный комплект может служить отличным подарком, который устроит любого автомобилиста или офисного работника, или руководителя. Его строгий стильный дизайн понравится любому пользователю.<br />\r\n<br />\r\n<strong>Поддерживаемые специальные функции:</strong><br />\r\n- Ответить/закончить разговор<br />\r\n- Ожидание/удержание вызова<br />\r\n- Голосовой набор<br />\r\n- Повтор последнего номера<br />\r\n&nbsp; Регулировка громкости<br />\r\n- Дополнительные функции: <br />\r\n&nbsp;   * Не требует специальной установки<br />\r\n&nbsp;   * Возможно использовать как настольный микрофон<br />\r\n&nbsp;   * Подключение до 5 телефонов<br />\r\n&nbsp;   * 2 встроенных динамика мощностью по 2 Вт<br />\r\n&nbsp;   * Преобразование текста в речь<br />\r\n&nbsp;   * На OLED-дисплее отображается имя вызывающего абонента<br />\r\n&nbsp;   * Автозагрузка адресной книги телефона<br />\r\n&nbsp;     подключение до 5 устройств<br />\r\n<br />\r\n<strong>Комплект поставки:</strong><br />\r\n&nbsp;   * Гарнитура<br />\r\n&nbsp;   * Автомобильное Зарядное устройство<br />\r\n&nbsp;   * Инструкция<br />\r\n<br />\r\n&nbsp;',184,'1410.00','1','1','2009-06-05 18:17:23','Bluetooth SonyEricsson 150','Bluetooth SonyEricsson 150','Bluetooth SonyEricsson 150','Bluetooth SonyEricsson 150','bluetooth-sonyericsson-150-','','','',0),(184,1,182,1,'Bluetooth Sony-Ericsson HBH IV840','<strong>Описание:</strong><br />\r\nBluetooth гарнитура SonyEricsson HBH-IV840 &ndash; это больше, чем просто изящество стиля. Отличный звук, высокая производительность и большое время разговора. Элегантный дизайн дарит удовольствие общения с помощью аудиоустройства Sony Ericsson HBH-IV840. Цифровая обработка сигналов (DSP), автоматический регулятор звука, функции: Auto pairing и автодозвон. <br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nHBH-IV840 &ndash; это больше, чем просто изящество стиля. Отличный звук, высокая производительность и большое время разговора&ndash; это серьёзная заявка!<br />\r\n<br />\r\n<strong>Поддерживаемые специальные функции:</strong><br />\r\n- Ответить/закончить разговор<br />\r\n- Ожидание/удержание вызова<br />\r\n- Голосовой набор<br />\r\n- Повтор последнего номера<br />\r\n&nbsp; Регулировка громкости<br />\r\n- Дополнительные функции: <br />\r\n&nbsp; индикатор состояния <br />\r\n&nbsp; Адаптивная скачкообразная перестройка частоты (AFH)<br />\r\n&nbsp;Auto pairing&trade; - эта функция позволяет устанавливать парное соединение между устройством и мобильным телефоном Bluetooth&trade; <br />\r\nАвтоматический регулятор звука<br />\r\n<br />\r\n<strong>Комплектация Sony Ericsson IV840:</strong><br />\r\nBluetooth-гарнитура Sony Ericsson HBH-IV840<br />\r\nЗарядное устройство CST-61<br />\r\nРемешок для ношения на шее<br />\r\nРуководство пользователя <br />\r\n<br />\r\n&nbsp;',185,'720.00','1','1','2009-06-05 18:17:23','Bluetooth Sony-Ericsson HBH IV840','Bluetooth Sony-Ericsson HBH IV840','Bluetooth Sony-Ericsson HBH IV840','Bluetooth Sony-Ericsson HBH IV840','bluetooth-sony-ericsson-hbh-iv840-','','','',2),(185,1,182,1,'Bluetooth Sony-Ericsson HBH-DS220 стерео','<strong>Описание:</strong><br />\r\nЗабудь об этих ужасных проводах! Гарнитура Bluetooth&trade; Sony Ericsson HBH-DS220 позволяет тебе и твоему собеседнику наслаждаться потрясающим качеством звука и дополняет твой образ стильным аксессуаром!<br />\r\nHBH-DS220 Bluetooth stereo гарнитура обеспечивает действительно великолепный звук! Цифровое шумо- и эхоподавление. Отличное качество звука и привлекательный дизайн делают эту гарнитуру превосходным устройством как для музыки, так и для общения где бы вы ни были.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nBluetooth-стереогарнитуры Sony Ericsson DS-220 представляют собой отлично сбалансированные решения среднего класса. Примечательный приятный дизайн и высокий уровень эргономики.<br />\r\n<br />\r\n<strong>Поддерживаемые специальные функции:</strong><br />\r\n- Ответить/закончить разговор<br />\r\n- Ожидание/удержание вызова<br />\r\n- Голосовой набор<br />\r\n- Повтор последнего номера<br />\r\n&nbsp; Регулировка громкости<br />\r\n- Дополнительные функции:&nbsp;<br />\r\n&nbsp; Монохромный дисплей<br />\r\n&nbsp;Два цвета(Черный,бордовый)<br />\r\n&nbsp; Металл в корпусе &nbsp;<br />\r\n&nbsp; Адаптивная скачкообразная перестройка частоты (AFH)<br />\r\n&nbsp;Auto pairing&trade; - эта функция позволяет устанавливать парное соединение между устройством  и мобильным телефоном Bluetooth&trade;&nbsp;<br />\r\n&nbsp;Автоматический регулятор звука<br />\r\nРазъем 3,5 мм<br />\r\n<br />\r\n<strong>Комплектация Sony Ericsson HBH-DS220:</strong><br />\r\nBluetooth-гарнитура Sony Ericsson HBH-DS220<br />\r\nЗарядное устройство<br />\r\nНаушники HPM-75<br />\r\nНасадки на наушники<br />\r\nРуководство пользователя&nbsp;<br />\r\n<br />\r\n<br />',186,'760.00','1','1','2009-06-05 18:17:23','Bluetooth Sony-Ericsson HBH-DS220 стерео','Bluetooth Sony-Ericsson HBH-DS220 стерео','Bluetooth Sony-Ericsson HBH-DS220 стерео','Bluetooth Sony-Ericsson HBH-DS220 стерео','bluetooth-sony-ericsson-hbh-ds220-stereo-','','','',2),(186,1,9,1,'Bluetooth Jabra 125 bt','<strong>Описание:</strong><br />\r\nJabra BT125 &ndash; элегантная недорогая беспроводная гарнитура для мобильных телефонов с интерфейсом Bluetooth. Эта гарнитура позволяет говорить по телефону, не прерывая других важных дел. Jabra BT125 - идеальный помощник, когда в течение дня приходится решать множество задач. Можно заниматься своими делами, совершать телефонные звонки и отвечать на них, не отвлекая для этого руки от важной работы! При управлении автомобилем, на прогулке с маленьким ребенком, когда гладите рубашку или просто сидите за чашечкой кофе &ndash; можно продолжать говорить по телефону, не подвергая опасности себя и окружающих.&nbsp;<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\n&nbsp;Качественная и простая в использовании гарнитура,со всеми необходимыми функциями по доступной цене<br />\r\n<br />\r\n<strong>Поддерживаемые специальные функции:</strong><br />\r\n- Ответить/закончить разговор<br />\r\n- Ожидание/удержание вызова<br />\r\n- Голосовой набор<br />\r\n- Повтор последнего номера<br />\r\n&nbsp; Регулировка громкости<br />\r\n- Дополнительные функции:&nbsp;<br />\r\n&nbsp; Монохромный дисплей<br />\r\n&nbsp;Два цвета(Черный,бордовый)<br />\r\n&nbsp; Металл в корпусе &nbsp;<br />\r\n&nbsp; Адаптивная скачкообразная перестройка частоты (AFH)<br />\r\n&nbsp;Auto pairing&trade; - эта функция позволяет устанавливать парное соединение между устройством  и мобильным телефоном Bluetooth&trade;&nbsp;<br />\r\n&nbsp;Автоматический регулятор звука<br />\r\nРазъем 3,5 мм<br />\r\n<br />\r\n<strong>Комплектация Sony Ericsson HBH-DS220:</strong><br />\r\nBluetooth-гарнитура Sony Ericsson HBH-DS220<br />\r\nЗарядное устройство<br />\r\nНаушники HPM-75<br />\r\nНасадки на наушники<br />\r\nРуководство пользователя&nbsp;<br />\r\n<br />\r\n<br />',187,'350.00','1','1','2009-06-05 18:17:23','Bluetooth Jabra 125 bt','Bluetooth Jabra 125 bt','Bluetooth Jabra 125 bt','Bluetooth Jabra 125 bt','bluetooth-jabra-125-bt-','','','',17),(187,1,9,1,'Bluetooth Jabra 2010','<strong>Описание:</strong><br />\r\nГарнитура Jabra BT2010 &ndash; это воплощение интеллектуального стиля общения. Эта элегантная гарнитура в гладком черном корпусе с металлическим обрамлением - полностью освобождает руки, исключительно проста в обращении и позволяет продолжать работу, не прерывая беседы по телефону. Гарнитура Jabra BT2010 является не только первоклассным и практичным дополнением к мобильному телефону &ndash; простота в работе, качество звука и удобство ношения превращают гарнитуру в надежного друга и помощника современного делового человека.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nЭлегантный дизайн, практичность, простота в обращении и отличное соотношение цены к функциональным возможностям<br />\r\n<br />\r\n&nbsp;<strong>Дополнительные функции:</strong><br />\r\n&bull;	автоматическое установление соединения при первом включении,<br />\r\n&bull;	ответ на вызов, завершение вызова, &nbsp;<br />\r\n&bull; Отклонение вызова<br />\r\n&bull; Голосовой набор<br />\r\n&bull; Повторный набор последнего номера<br />\r\n&bull; Ожидание вызова<br />\r\n&bull; Удержание вызова<br />\r\n&nbsp; Дополнительные функции:&nbsp;<br />\r\n&bull; Возможность подключения до 8 устройств,с возможностью одновременной связи только с одним из них&nbsp;<br />\r\n<br />\r\n<strong>Комплектация Jabra BT2010:</strong><br />\r\nBluetooth-гарнитура Jabra BT2010<br />\r\nЗарядное устройство с разьёмом miniUSB (SSA-5W-05)<br />\r\nДиск с руководством пользователя на 20 языках&nbsp;<br />\r\nРуководство пользователя<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />',188,'330.00','1','1','2009-06-05 18:17:23','Bluetooth Jabra 2010','Bluetooth Jabra 2010','Bluetooth Jabra 2010','Bluetooth Jabra 2010','bluetooth-jabra-bt-530-','','','',18),(188,1,9,1,'Bluetooth Jabra 3030','<strong>Описание:</strong><br />\r\nЕсли ваша цель - выделиться из толпы, то гарнитура Jabra BT3030 - как раз для этого и предназначена.<br />\r\nОригинальная Bluetooth стерео гарнитура Jabra BT3030 представляет собой компактное устройство в виде солдатского жетона, которое можно носить на шее как кулон, прикреплять с помощью специальной клипсы к одежде или просто убрать в карман. На гарнитуре размещены кнопки управления плеером и принятия вызова с голубой подсветкой.В комплект входят удобные вакуумные наушники с разъемом 3.5 мм. Хотя наличие обычного разъема дает возможность использовать свои любимые &laquo;уши&raquo;<br />\r\n<br />\r\n<strong>Достоинства :</strong><br />\r\nОтличная эргономика, универсальные разъемы, незаметные размеры и вес, качественные воспроизведение музыки и качество передачи речи, оригинальный молодежнйы дизайн...и все это Jabra BT3030.<br />\r\n<br />\r\n<strong>Поддерживаемые специальные функции:</strong><br />\r\n-автоматическое сопряжение при первом включении<br />\r\n-ответ на вызов/завершение вызова<br />\r\n-голосовой набор<br />\r\n-повторный набор последнего номера<br />\r\n-отклонение вызова<br />\r\n-удержание вызова/ожидание вызова<br />\r\n-отключение микрофона<br />\r\n-многоточечное подключение<br />\r\n-воспроизведение музыки<br />\r\n-дистанционное управление музыкальным проигрывателем<br />\r\n-бесшумный режим <br />\r\n<br />\r\n<strong>Комплект поставки:</strong><br />\r\n-Гарнитура<br />\r\n-Зарядное устройство<br />\r\n-Клипса<br />\r\n-Наушники<br />\r\n-Насадки на наушники<br />\r\n-Инструкция на miniCD<br />\r\n-&laquo;быстрое&raquo; руководство<br />\r\n<br />\r\n&nbsp;',189,'740.00','1','1','2009-06-05 18:17:23','Bluetooth Jabra 3030','Bluetooth Jabra 3030','Bluetooth Jabra 3030','Bluetooth Jabra 3030','bluetooth-jabra-3030-','','','',66),(189,1,9,1,'Bluetooth Jabra JX10 gold','<strong>Описание:</strong><br />\r\nJabra JX10 Gold  покрыта 24-каратовым золотом. Это придает гарнитуре уникальный стиль и гарантирует дизайн наилучшего качества.<br />\r\nCara &ndash; это вариант популярной гарнитуры из серии Jabra JX10, оснащенный самыми новыми технологическими решениями. Гарнитура была создана всемирно известной датской дизайнерской студией Якоба Йенсена (Jacob Jensen Design). Характерными чертами гарнитуры является классический стильный вид с выразительным симметричный корпусом, который придает ей элегантность.<br />\r\nНовая &laquo;золотая&raquo; гарнитура Jabra JX10 Cara Gold на данный момент произведено порядка 28,000, что позволит обладателю этой дорогой штучки выделятся среди других пользователей  Bluetooth гарнитур. Она весит около 11 граммов и поддерживает технологию Digital Signal Processing (DSP), которая обеспечивает кристальное качество передаваемого голоса и убирает фоновые шумы.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nВ Ваших руках &ndash; неподвластный времени шедевр, сочетающий совершенство нержавеющей стали и подлинную красоту золота! <br />\r\n<br />\r\n<strong>Поддерживаемые специальные функции:</strong><br />\r\n&nbsp;   * Набор номера голосом (при поддержке мобильным телефоном);<br />\r\n&nbsp;   * Отбой входящего вызова;<br />\r\n&nbsp;   * Ожидание вызова/удержание вызова (при поддержке мобильным телефоном);<br />\r\n&nbsp;   * Повторный набор последнего номера (при поддержке мобильным телефоном)<br />\r\n&nbsp;     Дополнительные функции: &nbsp;<br />\r\n&nbsp;     автоматическая подстройка громкости, <br />\r\n&nbsp;     отключение микрофона,<br />\r\n&nbsp;     цифровое шумо- и эхоподавление, <br />\r\n&nbsp;     индикатор состояния<br />\r\n&nbsp;     Вибровызов<br />\r\n<strong><br />\r\nКомплектация Jabra JX10 Cara Gold:</strong><br />\r\nBluetooth-гарнитура Jabra JX10 Cara Gold<br />\r\nЗарядное устройство<br />\r\nПодставка - крэдл для зарядки (уникальное дизайнерское решение),<br />\r\nКожаный мешочек для переноски<br />\r\nЦепочка для ношения на шее<br />\r\nАвтомобильное зарядное устройство<br />\r\n2 дужки за ухо<br />\r\nUSB-кабель<br />\r\nРуководство пользователя <br />\r\n<br />\r\n&nbsp;',190,'1570.00','1','1','2009-06-05 18:17:23','Bluetooth Jabra JX10 gold','Bluetooth Jabra JX10 gold','Bluetooth Jabra JX10 gold','Bluetooth Jabra JX10 gold','bluetooth-jabra-jx10-gold-','','','',19),(190,1,9,1,'Bluetooth Jabra JX20 black','<strong>Описание:</strong><br />\r\nBluetooth-гарнитура Jabra JX20 Pura в титановом корпусе сочетает в себе стильный минималистический дизайн и высокие технологии, которые превращают устройство в изысканный аксессуар, способный подчеркнуть тонкий вкус и высокий статус владельца. Лаконичный дизайн JX20 разработан известным дизайнерским ателье Якоба Йенсена.Титановый корпус надежно защищает гарнитуру от повреждения. Характерный неяркий блеск полированного титана прекрасно дополняют сверкающие угольно-черные детали гарнитуры.<br />\r\nВ устройстве реализована технология DSP, которая обеспечивает высочайшее качество передачи звука. Световой индикатор вызова LED оповестит пользователя о состоянии интерфейса Bluetooth, заряде аккумулятора и режиме зарядки неярким мягким светом в полном соответствии с лаконичным дизайном устройства.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\n&quot;Принцесса гарнитур&quot; - Jabra JX20 Pura Titanium Edition. Невероятно элегантное, функциональное устройство с красивейшим дизайном, удобной формой и кристально чистым качеством звучания.<br />\r\n<br />\r\n<strong>Поддерживаемые специальные функции:</strong><br />\r\n&nbsp; Ответить/закончить разговор<br />\r\n&bull; Перевод вызова<br />\r\n&bull; Сброс звонка<br />\r\n&bull; Функция автопаринга<br />\r\n&bull; Автоматическая подстройка громкости звука<br />\r\n&bull; Возможность зарядки от USB-порта<br />\r\n&bull; Повторный набор последнего номера<br />\r\n&bull; Набор номера голосом <br />\r\n&nbsp;Дополнительные функции: <br />\r\n* Индикатор состояния<br />\r\n* Цифровое шумо- и эхоподавление<br />\r\n<br />\r\n<strong>Комплектация Jabra JX20 Pura Titanium Edition:</strong><br />\r\n<br />\r\nBluetooth-гарнитура Jabra JX20 Pura Titanium Edition<br />\r\nЗарядное устройство<br />\r\nИнтеллектуальное зарядное устройство, <br />\r\nУшные вкладыши Jabra &ndash; 4 шт. ( 2 резиновых кольца и 2 каплевидных вкладыша)<br />\r\nЗаушники Jabra &ndash; 2 шт. (1 малый, 1 средний/большой)<br />\r\nКожаный шнурок для ношения на шее<br />\r\nUSB-кабель<br />\r\nБуклет Jabra JX20 Pura <br />\r\nРуководство пользователя <br />\r\n<br />\r\n<br />\r\n&nbsp;',191,'1560.00','1','1','2009-06-05 18:17:23','Bluetooth Jabra JX20 black','Bluetooth Jabra JX20 black','Bluetooth Jabra JX20 black','Bluetooth Jabra JX20 black','bluetooth-jabra-jx20-black-','','','',21),(191,1,9,1,'Bluetooth Jabra SP 700','<strong>Описание:</strong><br />\r\nГарнитура Jabra SP700 крайне несложна в использовании &ndash; не нужно никаких монтажных работ: достаточно закрепить ее на солнцезащитном козырьке. С помощью функции автоматического сопряжения гарнитура мгновенно и без хлопот подключается к телефону.&nbsp;<br />\r\nBluetooth громкая связь Jabra SP700 со встроенным FM-модулятором обеспечит Вам отличное качество звучания благодаря современной технологии шумо- и эхоподавления, которой оснащено устройство. Также можно передавать музыку с мобильного телефона на акустическую систему автомобиля через FM-модулятор и Bluetooth, плюс имеется очень полезная функция - устройство произносит голосом  номер входящего вызова!&nbsp;<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nSP700. Это новое элегантное и многофункциональное устройство громкой связи. Удобная функция голосовых сообщений, приемопередатчик FM-диапазона и превосходное качество звучания. Идеальный выбор для тех, кто не хочет нарушать закон, разговаривая по телефону за рулем автомобиля.<br />\r\n<br />\r\n<strong>Поддерживаемые специальные функции:</strong><br />\r\n- Ответить/закончить разговор<br />\r\n- Ожидание/удержание вызова<br />\r\n- Голосовой набор<br />\r\n- Повтор последнего номера<br />\r\n&nbsp; Регулировка громкости<br />\r\n- Дополнительные функции:&nbsp;<br />\r\n&nbsp; # Автоматическое установление соединения<br />\r\n# Ночной режим (отключаются световые сигналы, мешающие вождению в ночное время суток)<br />\r\n# Автоматическое выключение<br />\r\n# Полнодуплексный режим<br />\r\n# Подавление шума посредством технологии цифровой обработки сигналов&nbsp;<br />\r\n# FM передатчик для воспроизведения разговора или аудио записей<br />\r\n# Голосовые сообщения на 10 языках (в т.ч Русский)<br />\r\n&nbsp;  Функция отключения / приглушения звука аудиосистемы&nbsp;<br />\r\n<br />\r\n<strong>Комплектация:</strong><br />\r\nгромкая связь Bluetooth Jabra SP700,<br />\r\n&nbsp;автомобильная зарядка,<br />\r\n&nbsp;инструкция.<br />\r\n<br />\r\n<br />',192,'880.00','1','1','2009-06-05 18:17:23','Bluetooth Jabra SP 700','Bluetooth Jabra SP 700','Bluetooth Jabra SP 700','Bluetooth Jabra SP 700','bluetooth-jabra-sp-700-','','','',19),(192,1,9,1,'Bluetooth Jabra SP 5050','<strong>Описание:</strong><br />\r\nГарнитура Jabra SP5050 крайне несложна в использовании &ndash; не нужно никаких монтажных работ: достаточно закрепить ее на солнцезащитном козырьке. С помощью функции автоматического сопряжения гарнитура мгновенно и без хлопот подключается к телефону. Аккумулятор всегда можно зарядить с помощью автомобильного зарядного устройства. Не забыта и безопасность &ndash; в гарнитуре Jabra SP5050 предусмотрен &ldquo;Ночной режим&rdquo;, который не допустит отвлечения внимания водителя от управления автомобилем.<br />\r\nИнтуитивно понятные немногочисленные кнопки гарнитуры Jabra SP5050 очень удобны и обеспечивают безопасную связь за рулем. Более того, функция автоматического отключения не допустит разрядки аккумулятора, выключая питание гарнитуры через 15 минут после завершения соединения Bluetooth.Добавьте к этому новейшую технологию Bluetooth 2.0, обеспечивающую ускоренное соединение и улучшенное качество звука, &mdash; и Вы получите одно из самых технически совершенных устройств громкой связи с поддержкой Bluetooth на современном рынке.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nJabra SP5050 является идеальным для использования в автомобиле, доступное в цене устройство имеет  отличное звучание,хорошую эргономику и достаточно емкий аккумулятор.<br />\r\n<br />\r\n<strong>Поддерживаемые специальные функции:</strong><br />\r\n- Ответить/закончить разговор<br />\r\n- Ожидание/удержание вызова<br />\r\n- Голосовой набор<br />\r\n- Повтор последнего номера<br />\r\n&nbsp; Регулировка громкости<br />\r\n- Дополнительные функции:&nbsp;<br />\r\n&nbsp; # Автоматическое установление соединения<br />\r\n# Ночной режим<br />\r\n# Автоматическое выключение<br />\r\n# Полнодуплексный режим<br />\r\n# Подавление шума посредством технологии цифровой обработки сигналов&nbsp;<br />\r\n<br />\r\n<strong>Комплект поставки:</strong><br />\r\n&nbsp;   * Устройство Jabra SP5050<br />\r\n&nbsp;   * Зарядное устройство для прикуривателя<br />\r\n&nbsp;   * Инструкция<br />\r\n<br />\r\n<br />',193,'780.00','1','1','2009-06-05 18:17:23','Bluetooth Jabra SP 5050','Bluetooth Jabra SP 5050','Bluetooth Jabra SP 5050','Bluetooth Jabra SP 5050','bluetooth-jabra-sp-5050-','','','',19),(193,1,11,1,'Hands Free (Свободные руки) Iphone','<strong>Опиасние:</strong><br />\r\nПроводная стерео-гарнитура для Apple Iphone обладает хорошим качеством звучания, что позволит Вам не только комфортно разговаривать, но и слушать любимую музыку. Легкая и компактная гарнитура  оснащена пультом, который поможет Вам принимать/завершать вызовы, а так же регулировать звук и управлять MP3 плеером. При поступлении входящего звонка, музыка плавно затихает и управление передается телефонному модулю. После завершения звонка, воспроизведение музыки возобновляется.<br />\r\n<br />\r\n<strong>Достоинтва:</strong><br />\r\nОсобенностью стереогарнитуры является стандартный разъем 3,5мм, отличное звучание ее легкость и компактные размеры.<br />\r\n<br />\r\n<br />',194,'85.00','1','1','2009-06-05 18:17:23','Hands Free (Свободные руки) Iphone','Hands Free (Свободные руки) Iphone','Hands Free (Свободные руки) Iphone','Hands Free (Свободные руки) Iphone','hands-free-svobodnie-ryki-iphone-','','','',24),(194,1,193,1,'Hands Free (Свободные руки) Nokia AD-41','<strong>Описание:</strong><br />\r\nГарнитура Nokia AD-41/HS-20 предназначена специально для людей которые используют свой телефон не только для связи, но и в качестве плеера. Преимущество гарнитуры Nokia в том, что вы сможете спокойно и быстро управлять плеером с помощью пульта управления, также вместо стандартных пластмассовых наушников, которые не всегда удобны и часто &laquo;мозолят&raquo; ухо &ndash; наушники Nokia HS-20/AD41 имеют мягкие резиновые насадки, которые уже давно используются в телефонах Sony Ericsson серии Walkman. Такое устройство наушников не только позволяет долго носить гарнитуру не чувствуя дискомфорта, но и обеспечивает более лучшую звукоизоляцию. <br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nЕсли же вы настоящий меломан и входящие в комплект наушники вас не устраивают, то благодаря конструкции гарнитуры, которая состоит отдельно из двух частей: пульта управления и наушников возможно использовать собственные более качественные наушники с разъемом 3.5 мм.<br />\r\n<br />\r\n<strong>Комплектация:</strong><br />\r\nПереходник AD-41<br />\r\nНаушники HS-20<br />\r\nКомплект насадок для наушников: 3 размера<br />\r\n<br />\r\n<strong>Совместимость:</strong> <br />\r\nNokia 3250 Xpress Music<br />\r\nNokia 3250<br />\r\nNokia 5500 Music Edition <br />\r\nNokia 5500 Sport<br />\r\nNokia E50-1<br />\r\nNokia E50-2<br />\r\nNokia E60<br />\r\nNokia E61<br />\r\nNokia E61i<br />\r\nNokia E65<br />\r\nNokia E70<br />\r\nNokia N71<br />\r\nNokia N72<br />\r\nNokia N73 Music Edition<br />\r\nNokia N73<br />\r\nNokia N77<br />\r\nNokia N80 Internet Edition<br />\r\nNokia N80<br />\r\nNokia N93<br />\r\nNokia N93i<br />\r\n<br />\r\n&nbsp;',195,'105.00','1','1','2009-06-05 18:17:23','Hands Free (Свободные руки) Nokia AD-41','Hands Free (Свободные руки) Nokia AD-41','Hands Free (Свободные руки) Nokia AD-41','Hands Free (Свободные руки) Nokia AD-41','hands-free-svobodnie-ryki-nokia-ad-41-','','','',2),(195,1,193,1,'Hands Free (Свободные руки) Nokia AD-43','<strong>Описание:</strong><br />\r\nПриходилось ли вам долго и мучительно копошится в кармане, чтобы быстро перемотать композицию или переключить FM-радиостанцию, уменьшить звук и прочее? Теперь все эти функции вы сможете спокойно и быстро выполнять дистанционно с помощью пульта управления AD-43. Пульт нокиа AD-43 удобно крепится к вашей одежде с помощью прищепки.Данная гарнитура нокиа имеет много функциональных клавиш, таких как перемотка назад и вперед, уменьшение и увеличение звука, клавиша play/stop, а также одну из основных клавиш &ndash; пр