оставляется в подарочной упаковке, она не оставит без внимания тех кто ищет сувенир, такой подарок обязательно запомнится.Одной из возможностей флешки, является высокоскоростной интерфейс USB2.0 и хранение информации до 10 лет.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nЭта миниатюрная и изысканная модель, станет шикарным довершением вашего имиджа. <br />\r\n<br />\r\n<strong>Комлектация:</strong><br />\r\nUSB flash LG Platinum<br />\r\nшнурок для ношения на шее, <br />\r\nподарочная упаковка <br />\r\nСалфетка<br />\r\nдиск с ПО <br />\r\nИнструкция',250,'410.00','1','1','2009-06-05 18:17:24','Память USB 8Gb LG Platinum','Память USB 8Gb LG Platinum','Память USB 8Gb LG Platinum','Память USB 8Gb LG Platinum','pamyat-usb-8gb-lg-platinum','','','',21),(250,1,249,1,'Память USB 32 Gb','<strong>Описание:</strong><br />\r\nUSB flash 32gb предоставляет пользователям возможность легко и удобно хранить на одном устройстве рабочую и персональную информацию с сохранением большого объема свободного пространства для записи дополнительных данных. Теперь пользователи могут хранить и обмениваться целыми библиотеками музыки, фотографий, большими рабочими документами и даже видео. При этом им не нужно использовать несколько USB-накопителей или других устройств для хранения данных.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nНе большое USB устройство,но с очень большим объемом памяти станет вашим не заменимым помощнмком дома , на роботе и в офисе.',251,'600.00','1','1','2009-06-05 18:17:24','Память USB 32 Gb','Память USB 32 Gb','Память USB 32 Gb','Память USB 32 Gb','pamyat-usb-32-gb','','','',48),(251,1,249,1,'FM modulator с ЖК дисплеем','<strong>Описание:</strong><br />\r\n&nbsp;Теперь в Вашем авто появится не только полезное устройство, но и стильный аксессуар. Легкий MP3 FM модулятор прост в эксплуатации.<br />\r\nАвтомобильный MP3 FM модулятор.Оснащен пультом дистанционного управления и ЖК-дисплеем, на котором отображается частота, уровень звука и номер выбранной песни.<br />\r\nАвто MP3 FM модулятор позволяет слушать MP3 музыку в автомобиле на вашем FM радио.<br />\r\nС помощью него любое автомобильное FM радио приобретает функции полноценного MP3 плеера.Для этого достаточно вставить авто MP3 модулятор в гнездо прикуривателя и подключить к нему флэш-карту с MP3/WMA музыкой. После этого, настроив модулятор и авто радио на одну частоту, вы сможете наслаждаться вашими любимыми мелодиями в качественном стерео-звучании.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nНе большое и простое в эксплуатации устройство, с ЖК дисплеем и пультом ДУ, полностью превратит ваше автомобильное FM радио в полноценный MP3 плеер,с вашей любимой музыкой.Также примите во внимание, что USB Flash диск занимает уж куда меньше места, чем Ваша коллекция CD дисков и тем более аудио кассет.<br />\r\n<br />\r\n<strong>Дополнительны функции:</strong><br />\r\nLCD Дисплей<br />\r\nПульт ДУ<br />\r\nПоворачивающийся корпус<br />\r\nВстроенный предохранитель<br />\r\nЗапоминание FM радио-частоты<br />\r\nЗапоминание громкости<br />\r\nЗапоминание mp3 песни<br />\r\n<br />\r\n<strong>Особенности:</strong> аудио вход для внешних источников звука.<br />\r\n<br />\r\n<strong>Комплектация:</strong><br />\r\nFM&nbsp; modulator<br />\r\nПульт ДУ<br />\r\nАудио-Кабель 2.5/3.5мм<br />\r\nПредохранитель<br type=\"_moz\" />',252,'80.00','1','1','2009-06-05 18:17:24','FM modulator с ЖК дисплеем','FM modulator с ЖК дисплеем','FM modulator с ЖК дисплеем','FM modulator с ЖК дисплеем','fm-modulator-s-jk-displeem','','','',2),(252,1,249,1,'Trans Flash 16 Gb','<strong>Описание:</strong><br />\r\nКарта памяти microSD 16 Гб наполнит Ваш телефон множеством разной и полезной информацией. <br />\r\nНовое поколение карт microSD 16 Gb получили аббревиатуру microSD HC, что означает High-Capacity (большая емкость) . Поэтому если вы решили купить карту памяти большего объема, убедитесь что ваш телефон поддерживает данный объем.<br />\r\nКарта памяти&nbsp; microSD 16 Gb отформатирована под файловую систему FAT32, внешне схожа с картами памяти microSD, но может использоваться только с SDHC-совместимыми устройствами. Специальный адаптер, входящий в комплект поставки, позволяет использование microSDHC в слоте Secure Digital High-Capacity.<br />\r\nДанный объем карт памяти будет работать только с последними моделями мобильных телефонов, например Nokia 5800.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nС помощью карты microSD 16 Гб телефон станет хранилищем вашей персональной аудиотеки, фотографий и видео.<br />\r\n<br />\r\n<strong>Совместимость:</strong><br />\r\nMotorola: EM35; Q11; Z10<br />\r\nNokia: 5330 Xpress Music; 5630 Xpress Music; 5730 Xpress Music; 5800 Xpress Music; 6710 Navigator; E55; E75; N86<br />\r\nSamsung: I7110; I8910 16Gb; I8910; M6710 Beat DISC; M7600 Beat DJ; S8300<br />',253,'560.00','1','1','2009-06-05 18:17:24','Trans Flash 16 Gb','Trans Flash 16 Gb','Trans Flash 16 Gb','Trans Flash 16 Gb','trans-flash-16-gb','','','',5),(253,1,21,1,'Карман Mobilization','<strong>Описание:</strong><br />\r\nГоризонтальные модели карманов, футляров для мобильных телефонов изготавливаются из натуральной кожи с бархатной подложкой внутри. Дополнительные внутренние усилители увеличивают срок эксплуатации данного изделия и повышают эксплуатационные характеристики. Крепиться карман на пояс и благодаря металической скобе, надежно фиксирует Ваш телефонный аппарат. Выпускается в нескольких размерах, что позволяет использовать его даже для смартфонов и КПК.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nКарманы Mobilization - это прежде всего Качество, Сдержанность, Элегантность &ndash; именно эти качества характеризуют набор аксессуаров для мобильных телефонов делового человека.<br />\r\n<br />\r\n<strong>Дополнительно:</strong><br />\r\nКрепление:&nbsp; Двойное крепление на пояс, скоба и двойная шлёвка, Без крепления-&quot;компакт&quot;.<br />\r\nЗастёжка:&nbsp; Элемент застёжки - две кнопки магнит <br />\r\nЦвет кожи:&nbsp; Черный, коричневый, белый<br />',254,'50.00','1','1','2009-06-05 18:17:24','Карман Mobilization','Карман Mobilization','Карман Mobilization','Карман Mobilization','karman-mobilization','','','',31),(254,1,24,1,'Bluetooth USB 100м','<strong>Описание:</strong><br />\r\nПрактически невесомый адаптер беспроводной связи Bluetooth. Работает с Bluetooth-устройствами на расстоянии до 100 метров! Адаптер Bluetooth USB, позволяет организовать связь между ПК или ноутбуком с портом USB и устройствами, поддерживающими технологию Bluetooth (мобильными телефонами, портативными компьютерами, принтерами и т.д.)<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nАдаптер Bluetooth USB&nbsp; &ndash; быстрое и экономически выгодное решение для получения<br />\r\nбеспроводной связи вашего компьютера с любой периферией с интерфейсом&nbsp; Bluetooth.<br />\r\n<br />\r\n<strong>Совместимость с телефонами:</strong><br />\r\nСовместима практически со всеми bluetooth мобильными телефонами.<br />\r\n<br />\r\n<strong>Комплектация:</strong><br />\r\nАдаптер Bluetooth USB <br />\r\nДиск с ПО<br type=\"_moz\" />',255,'70.00','1','1','2009-06-05 18:17:24','Bluetooth USB 100м','Bluetooth USB 100м','Bluetooth USB 100м','Bluetooth USB 100м','bluetooth-usb-100m','','','',21),(255,1,25,1,'Кабель USB Samsung D800','<strong>Описание:</strong><br />\r\n&nbsp;Универсальный USB-кабель для телефона&nbsp; поможет вам использовать ваш мобильный телефон на 100%, подключив его к персональному компьютеру. Только так вы сможете узнать, что такое настоящее удобство, высокая скорость передачи данных, что позволяет вам значительно экономить ваше время (скорость передачи через дата кабель в 7-20 раз быстрее чем, через Bluetooth-интерфейс).Подключившись к компьютеру, вы можете пользоваться всеми функциями, предлагаемые вашим мобильным телефоном, в самых комфортных условиях: удобное программное обеспечение позволяет легко загружать картинки и мелодии, работать с записной книжкой.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nСамое быстрое подключение телефона к ПК для использования всех функций вашего мобильного телефона.<br />\r\n<br />\r\n<strong>Комплектация:</strong><br />\r\nUSB кабель Samsung D800<br />\r\nCD с драйвером<br />\r\n<br />\r\n<strong>Функции:</strong><br />\r\n1. Закачать мелодии в телефон.<br />\r\n2. Закачать логотипы,&nbsp; картинки и фотографии. При этом изменяя размеры и формат<br />\r\n3. Закачивать и удалять&nbsp; java игры и приложения.<br />\r\n4. Использовать модемное соединение для&nbsp; беспроводного выхода в интернет<br />\r\n5. Отправлять СМС набирая текст на клавиатуре ПК<br />\r\n6. Редактировать телефонную книгу<br />\r\n<strong><br />\r\nСовместимость:</strong><br />\r\nSamsung: D520; D800; D820; D830; D840; D900; D900i; E200; E250; E390; E480; E490; E500; E570; E590; E740; E780; E790; E830; E840; E900 Special Edition Gold; E900; E910; E950; F300; I520; I600; I620; I710; J600e; J610; L310; L320; L600; P300; P310; U100; U300; U600; U700; X820; X830; Z540<br />',256,'100.00','1','1','2009-06-05 18:17:24','Кабель USB Samsung D800','Кабель USB Samsung D800','Кабель USB Samsung D800','Кабель USB Samsung D800','kabel-usb-samsung-d800','','','',68),(256,1,25,1,'Кабель USB Samsung D880','<strong>Описание:</strong><br />\r\n&nbsp;Универсальный USB-кабель для телефона&nbsp; поможет вам использовать ваш мобильный телефон на 100%, подключив его к персональному компьютеру. Только так вы сможете узнать, что такое настоящее удобство, высокая скорость передачи данных, что позволяет вам значительно экономить ваше время (скорость передачи через дата кабель в 7-20 раз быстрее чем, через Bluetooth-интерфейс).Подключившись к компьютеру, вы можете пользоваться всеми функциями, предлагаемые вашим мобильным телефоном, в самых комфортных условиях: удобное программное обеспечение позволяет легко загружать картинки и мелодии, работать с записной книжкой.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nСамое быстрое подключ