Описание:</strong><br />\r\nCard Reader &ndash; это универсальное считывающее устройство. Работает с картами флэш-памяти, которые используют в цифровых фотоаппаратах и камерах, PDA, мобильных телефонах. Поддерживает все типы карт, в частности и новые высокоскоростные карты памяти, что позволяет быстро и легко передавать музыку, видео, фотографии или документы на различные виды портативных устройств.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nС помощью этого устройства вы за считанные секунды сможете передать всю информацию с вашей карты памяти на компьютер, а также за считанные секунды записать на нее любую информацию с вашего компьютера.<br />\r\n<br />\r\n<strong>Комплектация:</strong><br />\r\nУстройство Card Reader<br />\r\nUSB Кабель.<br type=\"_moz\" />',262,'70.00','1','1','2009-06-05 18:17:24','Card reader MMC/SD/MS/DUO/CF/IBM','Card reader MMC/SD/MS/DUO/CF/IBM','Card reader MMC/SD/MS/DUO/CF/IBM','Card reader MMC/SD/MS/DUO/CF/IBM','card-reader-mmcsdmsduocfibm','','','',17),(262,1,28,1,'Card reader + Bluetooth','<strong>Описание:</strong><br />\r\nКомпактный размер, мультиформатность, функциональность и привлекательный современный дизайн - основные достоинства этого удобного кардридера и Bluetooth адаптера одновременно&nbsp; . Card Reader&nbsp; поддерживает все типы карт, в частности и новые высокоскоростные карты памяти, что позволяет быстро и легко передавать музыку, видео, фотографии или документы на различные виды портативных устройств. Bluetooth поддерживает все современные профили и технологии и работает&nbsp; совсеми устроиствами поддерживающими технологию Bluetooth.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nБыстрое и экономически выгодное решение для получения беспроводной связи и чтения карт памяти. И все это вместе в одном не большом устройстве Card Reader + Bluetooth Adapter.<br />\r\n<br />\r\n<strong>Совместимость с телефонами:</strong><br />\r\nСовместима практически со всеми bluetooth мобильными телефонами.<br />\r\n<br />\r\n<strong>Комплектация:</strong><br />\r\nUSB&nbsp; Card Reader + Bluetooth Adapter<br />\r\nUSB Кабель<br type=\"_moz\" />',263,'140.00','1','1','2009-06-05 18:17:24','Card reader + Bluetooth','Card reader + Bluetooth','Card reader + Bluetooth','Card reader + Bluetooth','card-reader--bluetooth','','','',17),(263,1,30,1,'Колонки Nokia MD-1','&nbsp;<strong>Технические характеристики:</strong><br />\r\n- размер- 140х65х50mm<br />\r\n- вес- 200г.<br />\r\nРазъем 3.5мм<br />\r\nАккумулятор: встроен Li-ion<br />\r\nЗвук - стерео.<br />\r\n<br />\r\n<strong>Описание:</strong><br />\r\nТеперь, чтобы устроить праздник прямо здесь и прямо сейчас, не нужно бежать домой за магнитофоном, усилителем и колонками! Достаточно Твоего телефона и этих колонок! В комплекте переходники позволяющие подключить их к различным телефонам. Подзаряжать встроенную батарею можно зарядкой Твоего телефона!<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nЛегкие, практичные, можно всегда носить с собой. Качественный звук не оставит равнодушным любого меломана.&nbsp;<br />\r\n<br />\r\n<strong>Комплектация:</strong><br />\r\nКолонки<br />\r\nСумка<br />\r\nПереходники:2.5мм тип 6300/6120(совместимые с ним телефоны)<br />\r\n&nbsp;                   Nokia тип 3250/6233(совместимые с ним телефоны)<br />\r\n&nbsp;                    Sony Ericsson K750(совместимые с ним телефоны)<br />\r\n<br />\r\n<br />',264,'170.00','1','1','2009-06-05 18:17:24','Колонки Nokia MD-1','Колонки Nokia MD-1','Колонки Nokia MD-1','Колонки Nokia MD-1','kolonki-nokia-md-1-','','','',42),(264,1,30,1,'Колонки S/E MPS 2','&nbsp;<strong>Технические характеристики:</strong><br />\r\n- размер- 130х55х38mm<br />\r\n- вес- 157г.<br />\r\nРазъем Sony Ericsson K750(совместимые с ним)<br />\r\nАккумулятор: встроен Li-ion<br />\r\nЗвук - стерео.<br />\r\n<br />\r\n<strong>Описание:</strong><br />\r\nТеперь, чтобы устроить праздник прямо здесь и прямо сейчас, не нужно бежать домой за магнитофоном, усилителем и колонками! Достаточно Твоего телефона и этих колонок! В комплекте переходники позволяющие подключить их к различным телефонам. Подзаряжать встроенную батарею можно зарядкой Твоего телефона!<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nЛегкие, практичные, можно всегда носить с собой. Качественный звук не оставит равнодушным любого меломана.&nbsp;<br />\r\n<br />\r\n<strong>Комплектация:</strong><br />\r\nКолонки<br />\r\nСумка<br />\r\n<br />\r\n<br />',265,'245.00','1','1','2009-06-05 18:17:24','Колонки S/E MPS 2','Колонки S/E MPS 2','Колонки S/E MPS 2','Колонки S/E MPS 2','kolonki-se-mps-2-','','','',28),(265,1,31,1,'Подставка автомобильная Universal Kenzo','<strong>Описание:</strong><br />\r\n&nbsp;Держатель имеет раздвижной&nbsp; зажим&nbsp; и&nbsp; поддерживает широкий ряд мобильных устройств. Прочно удерживает телефон в автомобиле и позволяет менять совместимые устройства так часто, как вы захотите. Силиконовая присоска на гибкой штанге обеспечит очень надежное крепление автомобильного держателя к стеклу. <br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nБлагодаря стильному дизайну станет достойным дополнением в интерьер вашего автомобиля,и оличным аксессуаром для вашего телефона. <br />\r\n<br />\r\n<strong>Характеристики:</strong><br />\r\nТип:&nbsp; автомобильный<br />\r\nКрепление:&nbsp; Присоска / Гибкая штанга<br />\r\nДопустимая ширина устройств:&nbsp; 3,7см до 10,7см.<br />',266,'70.00','1','1','2009-06-05 18:17:24','Подставка автомобильная Universal Kenzo','Подставка автомобильная Universal Kenzo','Подставка автомобильная Universal Kenzo','Подставка автомобильная Universal Kenzo','podstavka-avtomobilnaya-universal-kenzo','','','',27),(266,1,33,1,'MP3 APACER AU350 1Gb Black','<strong>Описание:</strong><br />\r\nСоздан MP3 плеер для знатоков моды! Особый дизайн и компактный размер придают устройству современный вид. Устройство легко в переноске: компактные размеры позволяют меломанам повсюду наслаждаться любимыми композициями. Изящные формы плеера истинно радуют глаз. Специальное напыление и клавиатура из текстурного алюминия делают AU350 необычным на ощупь и придают выразительный вид.<br />\r\nХорошее качество воспроизведения является душой MP3 плеера, а хорошие наушники - одна из ступеней на лестнице, ведущей к совершенству. Неодимовые наушники Mylar прекрасно воспроизводят мощные басы и чистые высокие тона. Помимо этого, AU350 оборудован внешними кнопками для настройки эквалайзера (семь режимов). Хотите ли Вы раствориться в волнах стильного джаза или погрузиться в звуки тяжелого рока, - AU350 с легкостью создаст идеальную атмосферу для каждого жанра музыки, обеспечивая бесконечное наслаждение при прослушивании. LCD дисплей с подсветкой легко читается в темноте и придает плееру изысканную нотку. <br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nAU350: шикарный вид и идеальное качество звучания. Меломаны следуют тенденциям моды.<br />\r\n<br />\r\n<strong>Дополнительные ф-ции:</strong><br />\r\n- Специальная кнопка для переключения между 7 разными режимами эквалайзера - <br />\r\n&nbsp;       Normal, Pop, Rock, Classic, Jazz, Bass, Treble.<br />\r\n- 12 языков интерфейса (поддержка ID3 на экране) <br />\r\n- Высокочувствительные наушники(Выходная мощность наушников - (L) 10mW + (R) 10mW<br />\r\n&nbsp;     Сопротивление - 32 Ohm<br />\r\n&nbsp;     Соотношение сигнал/шум > 85 dB )<br />\r\n- Цвета корпуса: Черный Красный<br />\r\n<br />\r\n<strong>Комплект поставки:</strong><br />\r\n- плеер Apacer AU350,<br />\r\n- Наушники,<br />\r\n- USB-кабель,<br />\r\n- руководство по эксплуатации (инструкция)<br />\r\n<br />\r\n&nbsp;',268,'250.00','1','1','2009-06-05 18:17:24','MP3 APACER AU350 1Gb Black','MP3 APACER AU350 1Gb Black','MP3 APACER AU350 1Gb Black','MP3 APACER AU350 1Gb Black','mp3-apacer-au350-1gb-black-','','','',35),(267,1,33,1,'MP3 APACER AU350 2Gb Red','<strong>Описание:</strong><br />\r\nСоздан MP3 плеер для знатоков моды! Особый дизайн и компактный размер придают устройству современный вид. Устройство легко в переноске: компактные размеры позволяют меломанам повсюду наслаждаться любимыми композициями. Изящные формы плеера истинно радуют глаз. Специальное напыление и клавиатура из текстурного алюминия делают AU350 необычным на ощупь и придают выразительный вид.<br />\r\nХорошее качество воспроизведения является душой MP3 плеера, а хорошие наушники - одна из ступеней на лестнице, ведущей к совершенству. Неодимовые наушники Mylar прекрасно воспроизводят мощные басы и чистые высокие тона. Помимо этого, AU350 оборудован внешними кнопками для настройки эквалайзера (семь режимов). Хотите ли Вы раствориться в волнах стильного джаза или погрузиться в звуки тяжелого рока, - AU350 с легкостью создаст идеальную атмосферу для каждого жанра музыки, обеспечивая бесконечное наслаждение при прослушивании. LCD дисплей с подсветкой легко читается в темноте и придает плееру изысканную нотку. <br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nAU350: шикарный вид и идеальное качество звучания. Меломаны следуют тенденциям моды.<br />\r\n<br />\r\n<strong>Дополнительные ф-ции:</strong><br />\r\n- Специальная кнопка для переключения между 7 разными режимами эквалайзера - <br />\r\n&nbsp;       Normal, Pop, Rock, Classic, Jazz, Bass, Treble.<br />\r\n- 12 языков интерфейса (поддержка ID3 на экране) <br />\r\n- Высокочувствительные наушники(Выходная мощность наушников - (L) 10mW + (R) 10mW<br />\r\n&nbsp;     Сопротивление - 32 Ohm<br />\r\n&nbsp;     Соотношение сигнал/шум > 85 dB )<br />\r\n- Цвета корпуса: Черный Красный<br />\r\n<br />\r\n<strong>Комплект поставки:</strong><br />\r\n- плеер Apacer AU350,<br />\r\n- Наушники,<br />\r\n- USB-кабель,<br />\r\n- руководство по эксплуатации (инструкция)<br />\r\n<br />\r\n&nbsp;&nbsp;',269,'300.00','1','1','2009-06-05 18:17:24','MP3 APACER AU350 2Gb Red','MP3 APACER AU350 2Gb Red','MP3 APACER AU350 2Gb Red','MP3 APACER AU350 2Gb Red','mp3-apacer-au350-2gb-red-','','','',24),(268,1,33,1,'MP4 APACER AU840 4Gb Black','<strong>Описание:</strong><br />\r\nApacer  AU840 - мультимедийный центр с поддержкой MP4-файлов. Мягкий бархатистый материал корпуса приятен наощупь. Современный облик придает устройству глянцевый экран с диагональю 2,2 дюйма. Созданный на основе тонкопленочных транзисторов, он позволяет удивительно четко отображать фотографии высокого разрешения. Так как хороший звук &ndash; это душа плеера, достаточно много внимания было уделено именно этому аспекту. Две пары высокочувствительных наушников, входящих в комплект, точно передают богатство и насыщенность качественной аудиозаписи. При необходимости, наушники можно отключить и вывести стереозвук напрямую через встроенные динамики.<br />\r\nВдобавок, AU840 может играть роль и радиоприемника, принимая сигнал в диапазоне от 87,5 до 108 МГц и позволяя сохранять передачи в формате WAV. <br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nШикарный вид и идеальное качество звучания. Возможность подключения двух наушников сразу, не заставит вас соскучиться где бы вы не находились, на отдыхе, на роботе,дома или в дальней дороге.<br />\r\n<br />\r\n<strong>Дополнительные ф-ции:</strong><br />\r\n- Специальная кнопка для переключения между 7 разными режимами эквалайзера - <br />\r\n&nbsp;       Normal, Pop, Rock, Classic, Jazz, Bass, Treble.<br />\r\n- 12 языков интерфейса (поддержка ID3 на экране) <br />\r\n- Высокочувствительные наушники(Выходная мощность наушников - (L) 10mW + (R) 10mW<br />\r\n&nbsp;     Сопротивление - 32 Ohm<br />\r\n&nbsp;     Соотношение сигнал/шум > 85 dB )<br />\r\n- Два аудио выхода под наушники<br />\r\n- Внешний динамик<br />\r\n- Диктофон<br />\r\n<br />\r\n<strong>Комплектация MP4-плеера APACER AU840:</strong><br />\r\n- плеер Apacer  AU840 ,<br />\r\n- две пары наушников,<br />\r\n- USB-кабель,<br />\r\n- защитная сумочка<br />\r\n- руководство для быстрого старта,<br />\r\n- инсталяционный CD (Win98 драйвера и инструкция пользователя)<br />\r\n<br />\r\n&nbsp;',270,'900.00','1','1','2009-06-05 18:17:24','MP4 APACER AU840 4Gb Black','MP4 APACER AU840 4Gb Black','MP4 APACER AU840 4Gb Black','MP4 APACER AU840 4Gb Black','mp4-apacer-au840-4gb-black-','','','',24),(269,1,36,1,'Huawei E220 USB','<strong>Описание:</strong><br />\r\nМодем Huawei E220 представляет собой 3G USB модем, обеспечивающий безопасный, беспроводной доступ к e-mail, Интернет, корпоративным сетям, VPN и потоковому видео для Вашего компьютера.<br />\r\nПриложения, ранее доступные только в проводных сетях и через точки доступа WiFi, теперь работают, где бы Вы ни находились. Huawei E220 обеспечивает получение данных на скорости до 3,6 Mbps и передачу данных на скорости до 384 kbps в 3G UMTS сетях с поддержкой технологии HSDPA.<br />\r\nHuawei E220 подключается к ПК и получает питание через быстрый и удобный USB интерфейс, поэтому не требует зарядного устройства. Может быть подключен не только к переносному, но и к любому персональному компьютеру с поддержкой USB. <br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nЛёгкий, удобный модем с высокой чувствительностью приёмо-передающего тракта и доступной ценой не даёт шансов в конкуренции другим модемам USB.<br />\r\n<br />\r\n<strong>Дополнительные ф-ции:</strong><br />\r\nПрием и отправка SMS.<br />\r\nАвтоматическая установка драйвера<br />\r\n<br />\r\n<strong>Комплект поставки:</strong><br />\r\n- GSM модем Huawei E220; <br />\r\n- Кабель USB (2шт.)<br />\r\n&nbsp;Инструкция<br />\r\n<br />\r\n&nbsp;',272,'1190.00','1','1','2009-06-05 18:17:24','Huawei E220 USB','Huawei E220 USB','Huawei E220 USB','Huawei E220 USB','huawei-e220-usb-','','','',22),(270,1,36,1,'XU 870 ExpressCard','<strong>Описание:</strong><br />\r\nMerlin XU870 HSDPA ExpressCard является одним из последних дополнений в линейку Merlin. Продолжая свои усовершенствования и разработки Novatel-Wireless выпустила новую модель для Express слота. XU870 ExpressCard обеспечивает возможность высокоскоростного соединения к HSDPA сетям, передача данных&nbsp; до 7,2 Mbps.по всему миру. Эта карта имеет встроенную антенную систему, которая включает поворотную антенну, что максимизирует передачу данных и улучшает сигнал приема. Возможно подключение внешней антенны для улучшения приема сигнала.<br />\r\nКарта мобильного доступа Merlin XU870 ExpressCard работает под управлением программного обеспечения MobiLink. Это программное обеспечение позволяет управлять всеми средствами подключения к Интернет, доступными на Вашем ноутбуке, а также является легким в установке и использовании. Огромнымпреимуществом XU870, работающий на чипсете Qualcomm MSM 6280 является наличие специализированного эквалайзера (Mobile Receive Equalizer), который минимизирует радио помехи.<br />\r\n<br />\r\n<strong>Достоинства:</strong><br />\r\nMerlin XU870 HSDPA ExpressCard&nbsp; это заслуживающий доверия, надежный продукт имеющий более компактные размеры, чем традиционные PC cards, безопасный Интернет доступ, наличие специализированного эквалайзера, который минимизирует радио помехи и улучшенное управление питанием.<br />\r\n<br />\r\n<strong>Производитель:</strong><br />\r\nКорея Novatel Wireless<br />\r\n<br />\r\n<strong>Комплект поставки:</strong><br />\r\n&nbsp;Merlin XU870 Express card модем<br />\r\n&nbsp;CD-ROM с программным обеспечением Mobilink<br />\r\n&nbsp;Инструкция по работе с модемом<br type=\"_moz\" />',273,'1770.00','1','1','2009-06-05 18:17:24','XU 870 ExpressCard','XU 870 ExpressCard','XU 870 ExpressCard','XU 870 ExpressCard','xu-870-expresscard','','','',26),(271,1,40,1,'Джойстик Nokia 5610','<strong>Описание:<br />\r\n</strong>Двухпозиционный джойстик-слайдер для управления МР3-плеером и FM-радио.<br />\r\n<br />\r\n<strong>Дополнительно:</strong><br />\r\nЦвета: Черный, красный, синий<br />\r\n<br />\r\n<strong>Совместим со следующими моделями:</strong> <br />\r\nNokia 5610 XpressMusic<br />\r\n<br />\r\nДля замены рекомендуем обратиться в сервисный центр. <br />',275,'60.00','1','1','2009-06-05 18:17:24','Джойстик Nokia 5610','Джойстик Nokia 