INSERT INTO `bs_content` VALUES (1,1,1,1,'О компании','<p>Наш&nbsp;интернет-магазин рад представить вам всевозможный ассортимент разнообразных электронных помощьников в мире электроники.</p>','<p>&nbsp;</p>\n<p>Интернет-магазин <b>hypermarket.org.ua</b> представляет Вашему вниманию самый широкий ассортимент аксессуаров для мобильных телефонов, поставляемых со всех уголков нашей планеты. Выбирая наш интернет магазин Вы выбераете высокое качество товара, качественный сервис и поддержку. Наш интернет-магазин успешно работает на рынке с февраля 2008 года. Мы стараемся максимально учитывать интересы и пожелания наших клиентов. Наши технические специалисты ответят на любые вопросы, связанные со спецификацией продукции, спецификой работы, а так же доставкой товара. <br />\n<br />\nБудем рады откликнуться на все пожелания.</p>\n<p><br />\n<b>Сегодня Интернет-Магазин hypermarket.org.ua это:</b></p>\n<ul>\n    <li>Широчайший ассортимент товара - более 12 000 наименований</li>\n    <li>Регулярное обновление ассортимента аксессуаров на все модели телефонов</li>\n    <li>Высокое качество товара при доступной цене</li>\n    <li>Доставка товара  любым, удобным для клиента способом</li>\n    <li>Быстрое оформление и формирование заказа (наши менеджеры свяжутся с вами в течении 12 часов)</li>\n    <li>Заявки принимаются в любом виде ( по телефону, e-mail, факсу, лично)</li>\n    <li>Оплата по наличному или безналичному расчету, а так же принимаем электронные деньги!</li>\n    <li>Возможность заказа товара, которого никогда небыло на складе!</li>\n    <li>Персональный подход к любому клиенту</li>\n</ul>','1','2009-08-28 08:00:00','','О нас; как нас найти','О компании','',0,130,0,0),(2,1,1,1,'Контакты','','','1','2009-02-03 08:00:00','','','','',0,5,0,0),(9,1,18,1,'234234','<p>\n	sdfgdgdf</p>\n','<p>\n	cvxbcvbxcvbxc</p>\n','1','2010-02-20 00:00:00','','','','',0,0,0,0),(7,1,17,1,'вапв','<p>11111111111+</p>','<p>222222222222+</p>','1','2010-02-20 00:00:00','','','','',0,0,0,0),(8,1,17,